"321528":{"id":"321528","name":"Batman vs. Robin","slug":"batman-vs-robin","original_title":"Batman vs. Robin","overview":"Quando Damian Wayne assume o manto de Robin, ele passa a seguir um caminho de teimosia e imprudência ao lado de seu pai, o Batman. Enquanto investiga uma cena de crime, Robin encontra Talon, um sujeito misterioso que o leva até as profundezas de uma sociedade secreta de Gotham. Será uma jornada perigosa e que forçará Batman e Robin enfrentarem os seus adversário mais perigosos: um ao lado do outro.","first_air_date":"2015-04-03","runtime":72,"episode_run_time":[72],"vote_average":7.2,"created_by":["DC Entertainment","Warner Bros. Animation"],"production_companies":[{"name":"DC Entertainment"},{"name":"Warner Bros. Animation"}],"cast":["Jason O'Mara","Stuart Allan","David McCallum","Sean Maher","Jeremy Sisto"],"backdrop_path":"https://image.tmdb.org/t/p/original/g2XhZJhFiHcczWcXEEldItG53gd.jpg","poster_path":"https://image.tmdb.org/t/p/original/5LK9q1ovubLoH4Ajswve7pxr5Se.jpg","certification":"12","genres":["Ficção científica","Ação","Aventura","Animação","Crime","Drama","Fantasia","Thriller"],"trailer":"N/A"},
