"13248":{"id":"13248","name":"Bah Humduck! O Natal de Looney","slug":"bah-humduck-o-natal-de-looney","original_title":"Bah, Humduck!: A Looney Tunes Christmas","overview":"Versão de Looney Tunes de Conto de Natal, de Charles Dickens. Patolino é o ganancioso dono do Lucky Duck Mega-Mart e seus funcionários estão insatisfeitos, mas os fantasmas de Natal o fazem compreender o verdadeiro significado da data.","first_air_date":"2006-11-14","runtime":46,"episode_run_time":[46],"vote_average":7.1,"created_by":["Warner Bros. Animation"],"production_companies":[{"name":"Warner Bros. Animation"}],"cast":["Joe Alaskey","Bob Bergen","Billy West","June Foray","Maurice LaMarche"],"backdrop_path":"https://image.tmdb.org/t/p/original/mZbGLiSscsF2ipFt7su7gmSLn8l.jpg","poster_path":"https://image.tmdb.org/t/p/original/iViwiiOOoyUQLzbTACNlhw3jka.jpg","certification":"N/A","genres":["Animação","Comédia","Família"],"trailer":"N/A"},
"60293":{"id":"60293","name":"Tom & Jerry: Na Ilha do Tesouro","slug":"tom-jerry-na-ilha-do-tesouro","original_title":"Tom and Jerry: Shiver Me Whiskers","overview":"Tom aceita navegar como tripulante no barco do maior e mais temido pirata nos sete mares, o infame Capitão Vermelho. Cansado de esfregar o convés noite e dia, Tom acredita que sua sorte está mudando depois que encontra a bordo, uma misteriosa garrafa contendo um mapa do tesouro. O sonho de Tom ficar milionário vem abaixo quando ele descobre que dentro da garrafa está Jerry. O pobre rato tem guardado o mapa do tesouro e agora tem um ganancioso gato em suas patas. Jerry será forçado a caminhar pela prancha? Tom conseguirá chegar à ilha deserta antes? O tempo está passando, e Tom e Jerry precisam trabalhar juntos para vencer os desafios que essa caça ao tesouro propõe, antes que os piratas cheguem primeiro ao baú enterrado.","first_air_date":"2006-08-21","runtime":71,"episode_run_time":[71],"vote_average":6.9,"created_by":["Warner Bros. Animation","Turner Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"Turner Entertainment"}],"cast":["William Hanna","Mark Hamill","Kathy Najimy","Charles Nelson Reilly","Kevin Michael Richardson"],"backdrop_path":"https://image.tmdb.org/t/p/original/sTTQggCcbkf8KWmdYDx0kIhEXxI.jpg","poster_path":"https://image.tmdb.org/t/p/original/wgxmldGZgE8fIaTnhblSDhi2L5X.jpg","certification":"N/A","genres":["Animação","Comédia","Família","Aventura"],"trailer":"N/A"},
"15997":{"id":"15997","name":"Em Busca do Vale Encantado II: A Grande Aventura do Vale","slug":"em-busca-do-vale-encantado-ii-a-grande-aventura-do-vale","original_title":"The Land Before Time II: The Great Valley Adventure","overview":"A história continua no lindo e pacífico vale encantado onde Littlefoot e seus amigos vegetarianos moram e brincam sob o atento olhar de seus pais. Mas quando a desobediente Saura conduz o grupo para uma região proibida, os problemas aparecem: eles encontram dois ladrões de ovos chamados Ozzie e Strut, uma barulhenta Avalanche, dois ferozes tiranossauros, além de um misterioso ovo preste a chocar. Nesta incrível aventura, a turma do Vele Encantado vai aprender como é difícil crescer nesta envolvente história de esperança, amor e confiança.","first_air_date":"1994-12-12","runtime":73,"episode_run_time":[73],"vote_average":6.3,"created_by":["Universal Cartoon Studios","AKOM Production Company"],"production_companies":[{"name":"Universal Cartoon Studios"},{"name":"AKOM Production Company"}],"cast":["Scott McAfee","Candace Hutson","Heather Hogan","Jeff Bennett","Rob Paulsen"],"backdrop_path":"https://image.tmdb.org/t/p/original/8Db2ogq0e4UepMMxwqdv79YJMNq.jpg","poster_path":"https://image.tmdb.org/t/p/original/o8oBw8UCxsYVjj0pul0j1GGNJbk.jpg","certification":"L","genres":["Animação","Aventura","Família"],"trailer":"N/A"},
