"168903":{"id":"168903","name":"Barbie e as Sapatilhas Mágicas","slug":"barbie-e-as-sapatilhas-magicas","original_title":"Barbie in the Pink Shoes","overview":"Barbie é Kristyn, uma bailarina que tem grandes sonhos de mostrar sua dança, mas todos acham que ela dança mal. Quando ela calça um par de sapatilhas rosas brilhantes, ela e sua melhor amiga Hailey vão de uma maneira mágica ao fantástico mundo do balé. Lá, ela descobre que precisa dançar seguindo seu coração para derrotar a malvada Rainha das Neves.","first_air_date":"2013-02-14","runtime":75,"episode_run_time":[75],"vote_average":6.9,"created_by":["Mattel","Technicolor Animation"],"production_companies":[{"name":"Mattel"},{"name":"Technicolor Animation"}],"cast":["Kelly Sheridan","Katie Crown","Ali Liebert","Brett Dier","Tabitha St. Germain"],"backdrop_path":"https://image.tmdb.org/t/p/original/fpTjdag7KBAj5yubi37AYgtIb9c.jpg","poster_path":"https://image.tmdb.org/t/p/original/59FPQDQWyiPhDJH06mUeOxU0Oo5.jpg","certification":"N/A","genres":["Animação","Família"],"trailer":"N/A"},
"9385":{"id":"9385","name":"Asterix e os Doze Trabalhos","slug":"asterix-e-os-doze-trabalhos","original_title":"Les 12 travaux d'Astérix","overview":"Depois de mais uma tentativa de conquistar a vila gaulesa, alguns dos senadores romanos começam a suspeitar de que os moradores dali são, na verdade, uma espécie de deuses. César, para manter seu trono, envia à vila uma lista com doze tarefas que só poderiam ser realizadas por seres superiores. Se os gauleses vencerem o desafio, ele admitiria sua derrota. Caso contrário, se tornariam seus escravos. A proposta é aceita. Asterix, por ser o mais esperto, e Obelix, por ser o mais forte, são escolhidos para representar a vila. Com o peso de não falhar em uma só tarefa, os dois saem para cumprir os doze trabalhos e manter a dignidade gaulesa.","first_air_date":"1976-06-26","runtime":78,"episode_run_time":[78],"vote_average":7.3,"created_by":["Studios Idéfix","Dargaud Films","Les Productions René Goscinny","Halas and Batchelor Cartoon Films"],"production_companies":[{"name":"Studios Idéfix"},{"name":"Dargaud Films"},{"name":"Les Productions René Goscinny"},{"name":"Halas and Batchelor Cartoon Films"}],"cast":["Roger Carel","Jacques Morel","Pierre Tornade","Henri Labussière","Jean Martinelli"],"backdrop_path":"https://image.tmdb.org/t/p/original/lyQSifurKvWmqWzouVe50JFoI35.jpg","poster_path":"https://image.tmdb.org/t/p/original/qAr6KRxlXCRtkFXoLvnzEgnW9Iw.jpg","certification":"N/A","genres":["Família","Animação","Comédia","Aventura"],"trailer":"LPYn1d5hmqA"},
"504827":{"id":"504827","name":"Bob's Burger: O Filme","slug":"bob-s-burger-o-filme","original_title":"The Bob's Burgers Movie","overview":"Um cano rompido cria um buraco em frente ao Bob's Burgers, bloqueando a entrada e arruinando os planos de um verão bem-sucedido. Enquanto Bob e Linda lutam para manter o negócio, as crianças tentam resolver um mistério que pode salvar o restaurante da família. Os perigos aumentam, e eles se ajudam, lutando para voltar para trás do balcão.","first_air_date":"2022-05-26","runtime":102,"episode_run_time":[102],"vote_average":7.0,"created_by":["20th Century Studios","Bento Box Entertainment"],"production_companies":[{"name":"20th Century Studios"},{"name":"Bento Box Entertainment"}],"cast":["H. Jon Benjamin","Kristen Schaal","John Roberts","Dan Mintz","Eugene Mirman"],"backdrop_path":"https://image.tmdb.org/t/p/original/pTfUqVyM3mRuxvUiAvaSmdBrhdl.jpg","poster_path":"https://image.tmdb.org/t/p/original/h4NtdQn1Gm6wNLZDcCuasVPv3Oh.jpg","certification":"12","genres":["Animação","Aventura","Comédia"],"trailer":"ag7M3d2Y9D4"},
"41515":{"id":"41515","name":"Zé Colmeia: O Filme","slug":"ze-colmeia-o-filme","original_title":"Yogi Bear","overview":"Jellystone, está perdendo visitantes e, por isso, o prefeito Brown decide fechá-lo e vender suas terras. Inconformados com a perda da única casa que eles conhecem, Zé Colmeia terá que provar que ele realmente é \"o mais esperto de todos os ursos\" e com seu inseparável amigo Catatau, irá unir forças ao Guarda Smith para encontrar uma saída e salvar o parque de ser fechado para sempre.","first_air_date":"2010-12-17","runtime":80,"episode_run_time":[80],"vote_average":5.6,"created_by":["Sunswept Entertainment","De Line Pictures","Rhythm and Hues","Picnic Basket","Warner Bros. Pictures"],"production_companies":[{"name":"Sunswept Entertainment"},{"name":"De Line Pictures"},{"name":"Rhythm and Hues"},{"name":"Picnic Basket"},{"name":"Warner Bros. Pictures"}],"cast":["Dan Aykroyd","Justin Timberlake","Anna Faris","Tom Cavanagh","T.J. Miller"],"backdrop_path":"https://image.tmdb.org/t/p/original/olt6xjI8QvrTmm1GTH6VtX6ROCl.jpg","poster_path":"https://image.tmdb.org/t/p/original/fJznQfkWmN8MDnOvwxrt1UOnEAG.jpg","certification":"L","genres":["Comédia","Família","Animação","Aventura"],"trailer":"N/A"},
