"75629":{"id":"75629","name":"Evangelion: 3.0 Você (Não) Pode Refazer","slug":"evangelion-3-0-voce-nao-pode-refazer","original_title":"ヱヴァンゲリヲン新劇場版:Q","overview":"Quatorze anos se passaram desde o Terceiro Impacto. Shinji Ikari é resgatado da Unidade 01 e descobre que as coisas mudaram, mas não para melhor: O mundo foi devastado, seus antigos aliados da NERV tornaram-se hostis em relação a ele e Rei Ayanami, a menina que ele arriscou tudo para salvar, está longe de ser encontrada. Enquanto ele tenta se adaptar a esse estranho e novo mundo, Shinji faz amizade com o enigmático Kaworu Nagisa. Juntos na busca de Rei, os dois aprendem as terríveis verdades por trás dos Anjos, da NERV e dos Evangelions. Mas um raio de esperança permanece para os dois garotos: Uma oportunidade única para desfazer os erros do passado. Agora, os restos da humanidade estão atrás deles, os Anjos se apressam para detê-los e seus velhos amigos os declararam inimigos públicos número um. Apenas com Kaworu para apoiá-lo e todo o mundo contra ele, Shinji agora deve lutar por sua única chance de redenção. Mas isso pode significar terminar o que ele começou: O fim do mundo!","first_air_date":"2012-11-17","runtime":96,"episode_run_time":[96],"vote_average":7.2,"created_by":["khara"],"production_companies":[{"name":"khara"}],"cast":["緒方恵美","宮村優子","Akira Ishida","Megumi Hayashibara","Maaya Sakamoto"],"backdrop_path":"https://image.tmdb.org/t/p/original/q0PBB2RCrOAZrZjqJKhL3ibTV8b.jpg","poster_path":"https://image.tmdb.org/t/p/original/ymxd07nQZ9QzxTWr9g7v43xIJwS.jpg","certification":"N/A","genres":["Animação","Ficção científica","Ação","Drama"],"trailer":"ClOZrvp60Ek"},
"88212":{"id":"88212","name":"Preparação e Pouso: Operação Presente Secreto","slug":"preparacao-e-pouso-operacao-presente-secreto","original_title":"Prep & Landing Stocking Stuffer: Operation: Secret Santa","overview":"Wayne e Lanny, agora parceiros, são convocados por Magee para se encontrar com um contato secreto, a Sra. Papai Noel, que os envia a uma nova missão para recuperar uma caixa da oficina secreta do Papai Noel. Mais tarde, eles se aproximam do escritório do Papai Noel enquanto ele está dormindo, usando seu equipamento de alta tecnologia do filme anterior. A experiência da Lanny em vestir a árvore permite que eles entrem na oficina secreta onde eles recuperam a caixa e escapam apenas a tempo. Mas para que serve a caixa? (e Livre - Estimado Livre)","first_air_date":"2010-12-07","runtime":7,"episode_run_time":[7],"vote_average":6.4,"created_by":["Walt Disney Animation Studios"],"production_companies":[{"name":"Walt Disney Animation Studios"}],"cast":["Sarah Chalke","Dave Foley","Derek Richardson","William Morgan Sheppard","Betty White"],"backdrop_path":"https://image.tmdb.org/t/p/original/e1nCA9fswMsNdkdaCkVjdbcGmuG.jpg","poster_path":"https://image.tmdb.org/t/p/original/jM70oesdUFVfHrEdknBSB0cC5Ap.jpg","certification":"N/A","genres":["Animação","Família","Fantasia"],"trailer":"N/A"},
"324963":{"id":"324963","name":"Monster High: Assombrada","slug":"monster-high-assombrada","original_title":"Monster High: Haunted","overview":"Quando elas levam todo o estilo para os corredores da assustadora Haunted High! Um dia, quando as monstrinhas seguem a Spectra Vondergeist™, elas descobrem um mundo fantasma de arrepiar com uma escola assombrada. Apesar de logo fazer novos amigos fantasmagóricos, as monstrinhas tiveram uma recepção nada calorosa da Diretora Revenant, que pune Spectra com correntes de detenção e a impede de retornar a Monster High. Agora, é hora das amiguinhas monstras virarem fantasmas para impedir que Spectra desapareça para sempre.","first_air_date":"2015-03-02","runtime":75,"episode_run_time":[75],"vote_average":7.5,"created_by":["Mattel Playground Productions","Mattel","Nerd Corps Entertainment"],"production_companies":[{"name":"Mattel Playground Productions"},{"name":"Mattel"},{"name":"Nerd Corps Entertainment"}],"cast":["Haviland Stillwell","Karen Strassman","Laura Bailey","America Young","Cam Clarke"],"backdrop_path":"https://image.tmdb.org/t/p/original/ss3JMFi0D0KxbPfVLw9AwgpBiCW.jpg","poster_path":"https://image.tmdb.org/t/p/original/eEFH0SMlbvyht6QPQZs2LTO0t5M.jpg","certification":"L","genres":["Animação","Família","Fantasia"],"trailer":"N/A"},
