"15947":{"id":"15947","name":"Você Já Foi à Bahia?","slug":"voce-ja-foi-a-bahia","original_title":"The Three Caballeros","overview":"Pato Donald recebe uma grande caixa no dia de seu aniversário, trazendo três presentes. O primeiro traz um projetor de cinema, contendo um filme sobre aves da América do Sul. O segundo contém um livro sobre o Brasil, que o leva à Bahia ao lado de Zé Carioca. O terceiro tem uma piñata, acompanhada de Panchito. Com os amigos, Donald vive aventuras no Brasil e no México.","first_air_date":"1944-12-21","runtime":71,"episode_run_time":[71],"vote_average":6.3,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Clarence Nash","Sterling Holloway","Joaquin Garay","José do Patrocínio Oliveira","Aurora Miranda"],"backdrop_path":"https://image.tmdb.org/t/p/original/qQUPIgeVGp8bQErCyMpm9VZnHOG.jpg","poster_path":"https://image.tmdb.org/t/p/original/wllGcOAeh4bVNVNLK5H0thC74Cx.jpg","certification":"N/A","genres":["Animação","Família","Música"],"trailer":"N/A"},
"33875":{"id":"33875","name":"Heróis Pokémon: Latios & Latias","slug":"herois-pokemon-latios-latias","original_title":"劇場版ポケットモンスター 水の都の護神 ラティアスとラティオス","overview":"Alto Mare é uma ilha muito diferente. O estilo, a arquitetura, a localidade e até mesmo pelo que é famosa: uma cidade construída sobre a superfície da água. A beleza e os locais de Alto Mare deram-lhe o título de “A capital das águas”. Mas há algo por trás desta bela cidade... Uma lenda, relacionada aos Pokémon Irmãos Infinito, Latias e Latios. Eles protegem um tesouro, a Lágrima do Coração. O que acontecerá se ela cair em mãos erradas? É isto que Ash, Misty, Brock e Pikachu deveram impedir a qualquer custo. Mas eles não estarão sozinhos.","first_air_date":"2002-07-13","runtime":71,"episode_run_time":[71],"vote_average":6.6,"created_by":["Pikachu Project","Shogakukan Production","Tomy","The Pokémon Company","TV Tokyo","jeki","Media Factory","OLM","Shogakukan"],"production_companies":[{"name":"Pikachu Project"},{"name":"Shogakukan Production"},{"name":"Tomy"},{"name":"The Pokémon Company"},{"name":"TV Tokyo"},{"name":"jeki"},{"name":"Media Factory"},{"name":"OLM"},{"name":"Shogakukan"}],"cast":["松本梨香","Ikue Otani","飯塚雅弓","こおろぎさとみ","うえだゆうじ"],"backdrop_path":"https://image.tmdb.org/t/p/original/6nfEmbfWMuMBenYMOY6Vdho3Ycg.jpg","poster_path":"https://image.tmdb.org/t/p/original/vGH8Z20nC7KagAHagdfk9g8iAq5.jpg","certification":"N/A","genres":["Animação","Aventura","Ação","Fantasia","Ficção científica"],"trailer":"N/A"},
"15655":{"id":"15655","name":"Tigrão: O Filme","slug":"tigrao-o-filme","original_title":"The Tigger Movie","overview":"Trabalhando na construção de uma casa de inverno, Pooh, Leitão, Ió, Corujão e Coelho não conseguem terminá-la, porque Tigrão só pensa em brincar e não os deixa trabalhar. Então, Coelho aconselha Tigrão a procurar outros tigres, para não atrapalhar o trabalho da turma. Tigrão acha a idéia absurda, pois ele é o único tigre! Ou será que não? Começa, então, a divertida jornada de Tigrão em busca de sua família.","first_air_date":"2000-02-11","runtime":77,"episode_run_time":[77],"vote_average":6.6,"created_by":["Walt Disney Pictures","DisneyToon Studios","Disney Television Animation"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"DisneyToon Studios"},{"name":"Disney Television Animation"}],"cast":["Jim Cummings","Nikita Hopkins","Ken Sansom","John Fiedler","Peter Cullen"],"backdrop_path":"https://image.tmdb.org/t/p/original/60JMvMGuLHSlVjoUpi86UiB5Lmq.jpg","poster_path":"https://image.tmdb.org/t/p/original/q4oIYMOXIpCXveO218AVrvRPA40.jpg","certification":"L","genres":["Animação","Família","Comédia"],"trailer":"N/A"},
