"34067":{"id":"34067","name":"Pokémon: Lucario e o Mistério de Mew","slug":"pokemon-lucario-e-o-misterio-de-mew","original_title":"劇場版ポケットモンスター アドバンスジェネレーション ミュウと波導の勇者 ルカリオ","overview":"A história do filme começa muitos anos antes, quando uma terrível guerra entre humanos e Pokémon que estava ocorrendo e Aaron, um valente guerreiro, junto ao seu Lucario resolvem dar um fim nisso tudo e trazer a paz novamente ao mundo. Aaron acredita que indo até a Árvore da Origem e usando seu poder, tudo poderá ter fim, mas o caminho até a tal árvore é complicado e perigoso. Pensando nisso, Aaron decide selar Lucario em seu cetro, mesmo que o Pokémon não concordasse com isso. Logo em seguida, ele sobe em seu Pidgeot ruma à Árvore da Origem e coloca um fim na guerra. De volta ao presente, o povoado do qual Aaron e Lucario vivam estão comemorando um festival em homenagem aos dois heróis. Como parte do festival, existe um torneio de batalhas Pokémon onde o campeão será o representante de Aaron durante o festival.","first_air_date":"2005-07-16","runtime":100,"episode_run_time":[100],"vote_average":7.0,"created_by":["Pikachu Project","The Pokémon Company","Shogakukan","TV Tokyo","Media Factory","Tomy","jeki","OLM","Shogakukan Production"],"production_companies":[{"name":"Pikachu Project"},{"name":"The Pokémon Company"},{"name":"Shogakukan"},{"name":"TV Tokyo"},{"name":"Media Factory"},{"name":"Tomy"},{"name":"jeki"},{"name":"OLM"},{"name":"Shogakukan Production"}],"cast":["松本梨香","Ikue Otani","うえだゆうじ","KAORI","山田ふしぎ"],"backdrop_path":"https://image.tmdb.org/t/p/original/7qzuPx3ukGxCyLR9j0Ahg3fFI7r.jpg","poster_path":"https://image.tmdb.org/t/p/original/nRwdr4emOEGRJht4H7eFDLcrAom.jpg","certification":"N/A","genres":["Família","Aventura","Animação","Fantasia","Ação","Ficção científica"],"trailer":"N/A"},
"25913":{"id":"25913","name":"Balto 2: Aventura na Terra do Gelo","slug":"balto-2-aventura-na-terra-do-gelo","original_title":"Balto: Wolf Quest","overview":"Balto conseguiu capturar a imaginação do mundo e agora a aventura continua. Só que, desta vez, Balto não está só. Balto teve uma filha, Aleu. Enquanto, a jovem Aleu descobre que ela nunca será aceita como seus irmãos e irmãs, pois ela se parece mais a um lobo do que a um cão. Transtornada, ela foge na tentativa de encontrar um sentido para a sua vida e encontrar o seu verdadeiro lugar no mundo. Balto, preocupado, parte à procura de Aleu e, assim, tem início uma épica busca através da vastidão gélida do Alasca. Uma espetacular e alentadora aventura de muita coragem, descoberta e fascinação que ficará no seu coração para sempre.","first_air_date":"2002-04-30","runtime":78,"episode_run_time":[78],"vote_average":6.3,"created_by":["Universal Pictures","Universal Cartoon Studios"],"production_companies":[{"name":"Universal Pictures"},{"name":"Universal Cartoon Studios"}],"cast":["Maurice LaMarche","Jodi Benson","Lacey Chabert","David Carradine","Mark Hamill"],"backdrop_path":"https://image.tmdb.org/t/p/original/c9yWoqYOB0dA10CpsdEr5i9vK3R.jpg","poster_path":"https://image.tmdb.org/t/p/original/4FIrjCDgjA2lGAwT5N4W0geirnX.jpg","certification":"N/A","genres":["Família","Animação","Aventura"],"trailer":"N/A"},
