"618355":{"id":"618355","name":"Superman: Entre a Foice e o Martelo","slug":"superman-entre-a-foice-e-o-martelo","original_title":"Superman: Red Son","overview":"Quando o último filho de Krypton cai na Rússia, na época da Guerra Fria, em vez do bucólico Kansas, uma realidade alternativa se desdobra. Aqui, nós encontramos o Superman liderando uma campanha comunista para avançar as ideologias do estado soviético. Enquanto isso, do outro lado do Atlântico, Lex Luthor, um brilhante cientista americano, cria um plano para dominar e, por fim, destruir a ameaça alienígena soviética. O que vem a seguir é uma perseguição emocionante que colocará em risco toda a humanidade.","first_air_date":"2020-02-24","runtime":84,"episode_run_time":[84],"vote_average":7.1,"created_by":["Warner Bros. Animation","DC Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"}],"cast":["Jason Isaacs","Amy Acker","Diedrich Bader","Vanessa Marshall","Phil Morris"],"backdrop_path":"https://image.tmdb.org/t/p/original/uehwVV9xuALZ2SXeHGiX4Ay5dR7.jpg","poster_path":"https://image.tmdb.org/t/p/original/attHlVU6J8vO5QqSAqDmmF6Kt2A.jpg","certification":"N/A","genres":["Ficção científica","Animação","Ação"],"trailer":"N/A"},
"72972":{"id":"72972","name":"Tom & Jerry: O Mágico de Oz","slug":"tom-jerry-o-magico-de-oz","original_title":"Tom and Jerry & The Wizard of Oz","overview":"Tom e Jerry não estão mais no Kansas. Eles partiram para ver o mágico, o maravilhoso Mágico de Oz! Tom e Jerry passam pelo arco-íris e viajam pela estrada de tijolos amarelos nesta nova série animada baseada no conto clássico. Você verá seus personagens favoritos (Dorothy, Totó, o Espantalho, o Homem de Lata, o Leão, a Bruxa Malvada, o Mágico, os anões e muito mais), ouvirá muitas de suas músicas favoritas (incluindo \"Over the Rainbow\") e dará risadas com as travessuras do seu gato e rato favoritos conforme eles entram em um tornado, enfrentam macacos voadores e invadem o castelo da Bruxa Malvada tentando heroicamente levar Dorothy e Totó de volta para o Kansas. Afinal, não existe nenhum lugar como a nossa casa!","first_air_date":"2011-08-23","runtime":59,"episode_run_time":[59],"vote_average":6.3,"created_by":["Turner Entertainment","Warner Bros. Animation"],"production_companies":[{"name":"Turner Entertainment"},{"name":"Warner Bros. Animation"}],"cast":["Grey DeLisle","Joe Alaskey","Michael Gough","Rob Paulsen","Todd Stashwick"],"backdrop_path":"https://image.tmdb.org/t/p/original/uScjropoUuhfTP7O2U7h8VJYELQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/kUs6z0aZdJo99rJ62voOlF0BUOr.jpg","certification":"N/A","genres":["Animação","Comédia","Aventura","Família","Fantasia"],"trailer":"N/A"},
"857702":{"id":"857702","name":"LEGO Star Wars: Contos Aterrorizantes","slug":"lego-star-wars-contos-aterrorizantes","original_title":"LEGO Star Wars Terrifying Tales","overview":"Após os eventos de A Ascensão Skywalker, Poe e BB-8 devem realizar um pouso de emergência no planeta vulcânico Mustafar, onde encontram o ganancioso e conivente Graballa, o Hutt, que comprou o castelo de Darth Vader e está reformando-o para criar o primeiro hotel de luxo da galáxia inspirado nos Sith e com tudo incluso.","first_air_date":"2021-10-01","runtime":45,"episode_run_time":[45],"vote_average":6.8,"created_by":["Lucasfilm Ltd.","Atomic Cartoons","LEGO"],"production_companies":[{"name":"Lucasfilm Ltd."},{"name":"Atomic Cartoons"},{"name":"LEGO"}],"cast":["Jake Green","Raphael Alejandro","Dana Snyder","Tony Hale","Christian Slater"],"backdrop_path":"https://image.tmdb.org/t/p/original/f53Jujiap580mgfefID0T0g2e17.jpg","poster_path":"https://image.tmdb.org/t/p/original/fUOPfnGknCYmdTbAsrWsgvwR7Ah.jpg","certification":"L","genres":["Animação","Família","Ficção científica","Comédia","Cinema TV"],"trailer":"qyr5eSKm0mc"},
"10199":{"id":"10199","name":"O Corajoso Ratinho Despereaux","slug":"o-corajoso-ratinho-despereaux","original_title":"The Tale of Despereaux","overview":"Despereaux Tilling (Matthew Broderick) é um pequeno rato que sonha com aventuras. Um dia, ao visitar a biblioteca real, ele conhece a princesa Pea (Emma Watson). Ela lhe conta da tristeza que se abateu sobre ela e seu pai após a morte da rainha. Logo eles se tornam amigos, o que gera preocupação nos demais ratos, que são contrários às conversas com humanos. Desta forma Despereaux é levado ao Mundo das Ratazanas, onde não há luz. Ele é salvo por Roscuro (Dustin Hoffman), um rato banido pelos humanos mas que ainda sonha com atos heróicos.","first_air_date":"2008-12-18","runtime":93,"episode_run_time":[93],"vote_average":6.1,"created_by":["Larger Than Life Productions"],"production_companies":[{"name":"Larger Than Life Productions"}],"cast":["Matthew Broderick","Dustin Hoffman","Emma Watson","Tracey Ullman","Kevin Kline"],"backdrop_path":"https://image.tmdb.org/t/p/original/zsroSDR1aERgORUtbHBczq7F0Ke.jpg","poster_path":"https://image.tmdb.org/t/p/original/bneO9Ar9ZgWm5kRbqjsuR2GuxMg.jpg","certification":"L","genres":["Aventura","Animação","Família"],"trailer":"N/A"},
