"30178":{"id":"30178","name":"Stuart Little 3","slug":"stuart-little-3","original_title":"Stuart Little 3: Call of the Wild","overview":"A família Little vai longe nesta animada aventura selvagem super emocionante. Stuart e George vão para um acampamento longe da cidade de Nova York a fim de aprender as noções básicas de sobrevivência na selva com o grupo Escoteiros do Lago. Enquanto George aproveita a viagem junto com sua nova amizade com a bonitinha Brooke, Stuart aprende as suas melhores lições com o gambá Reeko. Já Snowbell faz com que gato Monty o proteja do famoso monstro da floresta, enquanto o resto da família curte a viagem sem se preocupar com nada.","first_air_date":"2005-07-14","runtime":75,"episode_run_time":[75],"vote_average":5.2,"created_by":["Mainframe Entertainment","Sony Pictures Home Entertainment","Red Wagon Entertainment"],"production_companies":[{"name":"Mainframe Entertainment"},{"name":"Sony Pictures Home Entertainment"},{"name":"Red Wagon Entertainment"}],"cast":["Michael J. Fox","Geena Davis","Hugh Laurie","Wayne Brady","Kevin Schon"],"backdrop_path":"https://image.tmdb.org/t/p/original/mwJ99qv48tE5Km7fLkeoOU1uVfK.jpg","poster_path":"https://image.tmdb.org/t/p/original/5BeiCNKNtAtN3tqzVtqhn1hyoKI.jpg","certification":"L","genres":["Animação","Comédia","Família"],"trailer":"N/A"},
