"485942":{"id":"485942","name":"Batman Ninja","slug":"batman-ninja","original_title":"ニンジャバットマン","overview":"Na trama, o Gorila Grodd é um senhor feudal e Batman enfrentará seu arqui-inimigo, Coringa. Mas o palhaço do caos recrutou as versões japonesas de outros vilões como Era Venenosa, Duas Caras, Arlequina e também o Pinguim. Vendo que ele não estava para brincadeira, o Cavaleiro das Trevas também trouxe amigos e recrutou Mulher-Gato, Asa Noturna, Robin e Alfred para seu time. A direção do longa animado fica por conta de Jumpei Mizusaki (JoJo’s Bizarre Adventure), o roteiro é de Kazuki Nakashima (Kill la Kill), o desenho dos personagens é foi feito por Takashi Okazaki (Afro Samurai) e a trilha sonora é de Yugo Kanno (Ajin, JoJo’s Bizarre Adventure). As animações são de Kamikaze Douga (JoJo’s Bizarre Adventure).","first_air_date":"2018-06-15","runtime":85,"episode_run_time":[85],"vote_average":5.8,"created_by":["Kamikaze Douga","DC Entertainment","Warner Bros. Japan","YAMATOWORKS"],"production_companies":[{"name":"Kamikaze Douga"},{"name":"DC Entertainment"},{"name":"Warner Bros. Japan"},{"name":"YAMATOWORKS"}],"cast":["Koichi Yamadera","高木渉","Rie Kugimiya","加隈亜衣","Hochu Otsuka"],"backdrop_path":"https://image.tmdb.org/t/p/original/geeAPcb9iBEWfft6uRnL8aCwBmF.jpg","poster_path":"https://image.tmdb.org/t/p/original/zaw7PQ7GvTliBVmfg2o8OJfhWjU.jpg","certification":"N/A","genres":["Animação","Ação","Ficção científica"],"trailer":"N/A"},
