"13417":{"id":"13417","name":"A Nova Onda do Kronk","slug":"a-nova-onda-do-kronk","original_title":"Kronk's New Groove","overview":"Depois de suas incríveis experiências com Pacha e o Imperador Kuzco, o amável Kronk – antigo ajudante de Yzma – está muito feliz com sua nova vida, sendo chef de seu próprio restaurante. Entretanto, uma louca aventura começa quando recebe a notícia de que seu pai lhe fará uma visita. Kronk apronta a maior confusão com a ajuda da esperta feiticeira Yzma tentando se passar por um homem de sucesso para impressionar o pai. Depois de uma série de mancadas e uma verdadeira explosão de queijos no restaurante, Kronk está realmente encrencado. E somente com a ajuda de seus amigos é que ele aprende a ser fiel à sua onda.","first_air_date":"2005-12-05","runtime":75,"episode_run_time":[75],"vote_average":6.4,"created_by":["Disney Television Animation","DisneyToon Studios","Walt Disney Home Video"],"production_companies":[{"name":"Disney Television Animation"},{"name":"DisneyToon Studios"},{"name":"Walt Disney Home Video"}],"cast":["Patrick Warburton","Tracey Ullman","Eartha Kitt","David Spade","John Goodman"],"backdrop_path":"https://image.tmdb.org/t/p/original/b7Gs13mynMDYhwr7gpgriS96ZKa.jpg","poster_path":"https://image.tmdb.org/t/p/original/7g5Y8bLhThN91pqhJs7KVylwIXi.jpg","certification":"L","genres":["Animação","Comédia","Família"],"trailer":"N/A"},
