"28460":{"id":"28460","name":"Sailor Moon Super S O Filme – O Buraco Negro dos Sonhos","slug":"sailor-moon-super-s-o-filme-o-buraco-negro-dos-sonhos","original_title":"劇場版 美少女戦士セーラームーンSuperS セーラー9戦士集結！ブラック・ドリーム・ホールの奇跡","overview":"Em todo o mundo, as crianças dormem. Sem saber do perigo que espreita nas sombras. Mas esta noite, uma escuridão estranha flutua ao vento. E as crianças, uma por uma, começam a desaparecer. Parece ser uma força sobrenatural que se alimenta de seus sonhos. A rainha má, Badiyanu, fadas e seu fiel auxiliar na utilização do \"Black Dream Hole\" engolir a Terra. Cabe a Sailor Moon e Sailor soldados para evitar a escuridão que se aproxima.","first_air_date":"1995-12-23","runtime":60,"episode_run_time":[60],"vote_average":7.9,"created_by":["Toei Animation"],"production_companies":[{"name":"Toei Animation"}],"cast":["三石琴乃","荒木香衣","富沢美智恵","久川綾","篠原恵美"],"backdrop_path":"https://image.tmdb.org/t/p/original/xbEmI681B0aeYkIXQ2Nlfj42GCF.jpg","poster_path":"https://image.tmdb.org/t/p/original/l4581wcyijDobLrPUjr6SR6DILh.jpg","certification":"N/A","genres":["Animação","Fantasia","Ação","Romance","Comédia"],"trailer":"N/A"},
