"382322":{"id":"382322","name":"Batman: A Piada Mortal","slug":"batman-a-piada-mortal","original_title":"Batman: The Killing Joke","overview":"Do produtor executivo Bruce Timm e baseado na aclamada graphic novel da DC Comics, “Batman: A Piada Mortal” é uma jornada adentro da sombria psique do Príncipe Palhaço do Crime. Acompanhando desde o seu humilde começo, quando era um comediante esforçado, até seu fatídico encontro com o Cavaleiro das Trevas, que mudou tudo. Agora fugitivo do Asilo Arkham, o Coringa planeja provar para todos que um dia ruim é capaz de tornar qualquer um tão insano quanto ele.","first_air_date":"2016-07-24","runtime":72,"episode_run_time":[72],"vote_average":6.6,"created_by":["Warner Bros. Animation","DC Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"}],"cast":["Kevin Conroy","Mark Hamill","Tara Strong","Ray Wise","John DiMaggio"],"backdrop_path":"https://image.tmdb.org/t/p/original/2jApwp78umL4dK9uSBJAngNDiG9.jpg","poster_path":"https://image.tmdb.org/t/p/original/x5hsAHiwLQrM7jlSZzR7AdWZquk.jpg","certification":"14","genres":["Ação","Animação","Crime","Drama"],"trailer":"N/A"},
