"597845":{"id":"597845","name":"Os Peludos","slug":"os-peludos","original_title":"Финник","overview":"Poucas pessoas sabem que todas as casas são habitadas por finlandeses. São criaturas peludas que aparecem no mundo humano para cuidar de uma casa e manter a lareira. Finnick é um jovem finlandês, que não parece se importar com sua responsabilidade de fazer da casa um lar. Ele está apenas fazendo brincadeiras com «seu povo» e é por isso que nenhuma das famílias quis ficar muito tempo em sua casa. Tudo muda quando uma nova família chega à sua casa, onde os truques de Finnick não funcionam, e ele conhece Christine, de 13 anos, e eventos inexplicáveis ​​começam a acontecer na cidade. Finnick e Christine, que são tão diferentes, terão que se unir e trabalhar juntos para resolver o mistério dos eventos e salvar a cidade.","first_air_date":"2022-03-24","runtime":85,"episode_run_time":[85],"vote_average":7.4,"created_by":["Riki Group","Animation Studio \"Petersburg\"","Cinema Foundation of Russia","Viva Kids"],"production_companies":[{"name":"Riki Group"},{"name":"Animation Studio \"Petersburg\""},{"name":"Cinema Foundation of Russia"},{"name":"Viva Kids"}],"cast":["Данила Милохин","Ида Галич","Александр Гудков","Артур Бабич","Борис Дергачёв"],"backdrop_path":"https://image.tmdb.org/t/p/original/cH5mdqHFVUuZ7Votxfkki4pd4HT.jpg","poster_path":"https://image.tmdb.org/t/p/original/q0poNkSayOtlwRzY6MKHTQcBauq.jpg","certification":"L","genres":["Comédia","Aventura","Animação","Fantasia","Família"],"trailer":"N/A"},
