"39057":{"id":"39057","name":"Pokémon: Arceus e a Jóia da Vida","slug":"pokemon-arceus-e-a-joia-da-vida","original_title":"劇場版ポケットモンスター ダイヤモンド&パール アルセウス 超克の時空へ","overview":"A batalha de tempo e espaço, de mundos distorcidos e dimensões alternativas segue firme, e Ash e seus amigos se encontram novamente no meio de mais uma batalha! A Cidade de Michina está no coração da batalha e possui um passado longo marcado por Arceus. Após Arceus conceder um pouco do seu poder aos cidadãos da cidade com a Joia da Vida, eles traem o Pokémon Mítico! Ao lado de sua nova amiga, Sheena, Ash e seus amigos devem usar o poder de Dialga para viajar no tempo e tentar corrigir os erros dos seus antepassados antes que o mundo seja destruído com a fúria de Arceus. Será que os antepassados de Sheena realmente traíram Arceus? Serão os nossos heróis capazes de corrigir os erros do passado?","first_air_date":"2009-07-18","runtime":94,"episode_run_time":[94],"vote_average":7.1,"created_by":["OLM","Pikachu Project","The Pokémon Company","Shogakukan","TV Tokyo","Media Factory","TakaraTomy","jeki","Shogakukan-Shueisha Productions"],"production_companies":[{"name":"OLM"},{"name":"Pikachu Project"},{"name":"The Pokémon Company"},{"name":"Shogakukan"},{"name":"TV Tokyo"},{"name":"Media Factory"},{"name":"TakaraTomy"},{"name":"jeki"},{"name":"Shogakukan-Shueisha Productions"}],"cast":["松本梨香","Ikue Otani","うえだゆうじ","豊口めぐみ","小桜エツコ"],"backdrop_path":"https://image.tmdb.org/t/p/original/1WygXLVPO4wNYm6WUgUi7PNAvkU.jpg","poster_path":"https://image.tmdb.org/t/p/original/pzqwhVEaBDKPbfici20mTXMQY5D.jpg","certification":"N/A","genres":["Família","Animação","Aventura","Fantasia"],"trailer":"N/A"},
"15653":{"id":"15653","name":"Pateta 2: Radicalmente Pateta","slug":"pateta-2-radicalmente-pateta","original_title":"An Extremely Goofy Movie","overview":"Max descobre o sabor da liberdade quando chega à universidade. Ao mesmo tempo, seu pai sente tanto sua falta que perde a concentração no trabalho e é despedido. À procura de um emprego melhor, Pateta une o útil ao agradável: volta a estudar e, assim, fica perto de seu filho. A alegria do garoto acaba, quando Pateta aparece com um visual \"anos 70\", deixando-o profundamente envergonhado. Com a ajuda de uma linda bibliotecária, Pateta revive o melhor de sua juventude, espalhando pelo campus um clima de discoteca da época de \"Embalos de Sábado à Noite\". Agora, pai e filho precisam aprender a viver suas próprias vidas... juntos!","first_air_date":"2000-02-29","runtime":79,"episode_run_time":[79],"vote_average":6.4,"created_by":["Disney Television Animation","Walt Disney Animation"],"production_companies":[{"name":"Disney Television Animation"},{"name":"Walt Disney Animation"}],"cast":["Bill Farmer","Jason Marsden","Jeff Bennett","Jim Cummings","Brad Garrett"],"backdrop_path":"https://image.tmdb.org/t/p/original/2XoHSRRhwSdv42suJMJBgEyWy5b.jpg","poster_path":"https://image.tmdb.org/t/p/original/6R9fbKe3A3cyVdNO9G1HPtysFrH.jpg","certification":"N/A","genres":["Animação","Família","Comédia"],"trailer":"N/A"},
