"11114":{"id":"11114","name":"Meu Amigo, o Dragão","slug":"meu-amigo-o-dragao","original_title":"Pete's Dragon","overview":"No começo do século 20, na Nova Inglaterra, Pete é um menino de nove anos de idade que foge dos violentos pais adotivos. Ele só tem um amigo: um dragão chamado Elliott. Pete e Elliott vão parar numa pequena cidade e passam a viver com Nora e o pai dela, Lampie, zelador do farol da cidade. O problema é que o dragão Elliott é descoberto por um médico sem escrúpulos que quer usar o bichão com propósitos medicinais. Mistura de desenho animado e atores.","first_air_date":"1977-11-03","runtime":105,"episode_run_time":[105],"vote_average":6.3,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Sean Marshall","Helen Reddy","Jim Dale","Mickey Rooney","Red Buttons"],"backdrop_path":"https://image.tmdb.org/t/p/original/y6c9KJ7nDOlSAnyKXPKQs3mV3fx.jpg","poster_path":"https://image.tmdb.org/t/p/original/defjcH3Wyd5xWI9gzmB7dkSeGyT.jpg","certification":"N/A","genres":["Fantasia","Animação","Comédia","Família"],"trailer":"N/A"},
