"382581":{"id":"382581","name":"Monster High: A Assustadora Barreira de Coral","slug":"monster-high-a-assustadora-barreira-de-coral","original_title":"Monster High: Great Scarrier Reef","overview":"Junte-se as suas monstrinhas preferidas em uma nova aventura aquática! Quando as monstrinhas são empurradas e caem na piscina da escola, elas são transportadas para um mundo submarino: a Assustadora Barreira de Coral. A Lagoona vê que está em casa em uma missão de arrepiar onde decide enfrentar os próprios medos de uma vez por todas. É claro que ela vai precisar da ajuda das melhores amigas ao combater um inimigo do passado, competir em um campeonato de dança e lutar com um assustador monstro marino!","first_air_date":"2016-02-12","runtime":69,"episode_run_time":[69],"vote_average":7.8,"created_by":["Mattel","Nerd Corps Entertainment"],"production_companies":[{"name":"Mattel"},{"name":"Nerd Corps Entertainment"}],"cast":["Larissa Gallagher","Kate Higgins","Debi Derryberry","Salli Saffioti","America Young"],"backdrop_path":"https://image.tmdb.org/t/p/original/w690FKJNicYzAuIrt2X9uJS6cf0.jpg","poster_path":"https://image.tmdb.org/t/p/original/vBwCOm1Jt9VWcVAOgDJBgri5zxB.jpg","certification":"N/A","genres":["Família","Animação"],"trailer":"N/A"},
"355111":{"id":"355111","name":"Barbie: Rainhas do Rock","slug":"barbie-rainhas-do-rock","original_title":"Barbie in Rock 'N Royals","overview":"Prepare-se para arrasar! No musical Barbie Rock’n Royals, Barbie estrela como Courtney, uma princesa moderna que tem seu mundo virado de ponta-cabeça ao trocar de lugar com Erika, uma famosa estrela do rock. Dois estilos completamente diferentes se chocam quando a Princesa Courtney vai para o acampamento pop e Erika para o acampamento da realeza. Enquanto os líderes dos acampamentos rivais tentam corrigir o engano, Courtney e Erika têm que aprender a se ajustar a um mundo novo e se divertem ao fazer novos e inesperados amigos. Quando as garotas descobrem que os acampamentos estão correndo o risco de fechar, elas devem conciliar suas diferenças e encontrar suas verdadeiras vozes, em uma épica aventura para descobrir que a música tem o poder de unir a todos!","first_air_date":"2015-08-12","runtime":84,"episode_run_time":[84],"vote_average":6.9,"created_by":["Mattel","Rainmaker Entertainment"],"production_companies":[{"name":"Mattel"},{"name":"Rainmaker Entertainment"}],"cast":["Kelly Sheridan","Chiara Zanni","Bethany Brown","Devyn Dalton","Michael Dobson"],"backdrop_path":"https://image.tmdb.org/t/p/original/4nOShZSE5V5MWZgZs4NjDcDHiSo.jpg","poster_path":"https://image.tmdb.org/t/p/original/mROC6QlvNMRsHGak0Vijx6Y5KcN.jpg","certification":"N/A","genres":["Animação","Música","Família"],"trailer":"N/A"},
