"24696":{"id":"24696","name":"Tom & Jerry: O Quebra-Nozes","slug":"tom-jerry-o-quebra-nozes","original_title":"Tom and Jerry: A Nutcracker Tale","overview":"Em um teatro vazio, depois de ter assistido o balé, Jerry deseja uma chance de se apresentar e, por mágica, seu sonho vira realidade: é transportado para o mundo encantado do quebra-nozes e dos brinquedos falantes. Depois de Tom ver o reino os gatos dominam o reino de Jerry, Tuffy e a bailarina. E então Tom lança Jerry,Paulie e a Nelly num canhão. Mas como a magia é frágil, eles abriram muitos portais mágicos mandaram os três para o Ártico. E depois de Jerry e Paulie descobriram que Nelly só fala quando alguém puxa sua corda. Nelly dá a ideia de procurar o Criador de Brinquedos para ajudá-los. Fazendo com que eles passem por muitos locais diferentes.","first_air_date":"2007-10-02","runtime":46,"episode_run_time":[46],"vote_average":6.8,"created_by":["Turner Entertainment","Warner Bros. Animation"],"production_companies":[{"name":"Turner Entertainment"},{"name":"Warner Bros. Animation"}],"cast":["Kathleen Barr","Garry Chalk","Ian James Corlett","Trevor Devall","Richard Newman"],"backdrop_path":"https://image.tmdb.org/t/p/original/7YbVGZaxJWipyqgPOzJxjtUrwLA.jpg","poster_path":"https://image.tmdb.org/t/p/original/rdvXemWx3LuIQ0c2UMk4dQJ9KJ2.jpg","certification":"N/A","genres":["Animação","Comédia","Família"],"trailer":"N/A"},
