"19585":{"id":"19585","name":"Força-G","slug":"forca-g","original_title":"G-Force","overview":"Durante mais de cem anos o governo norte-americano treinou e espalhou animais como agentes espiões. Agora o avanço da tecnologia permitiu que fosse criada uma equipe espiã disfarçada, chamada Força G, composta apenas por animais. Contando com o que há de mais moderno em equipamentos de espionagem, o grupo é liderado pelo porquinho-da-índia Darwin (Sam Rockwell) e composto ainda pelos também porquinhos-da-índia Blaster (Tracy Morgan) e Juarez (Penélope Cruz) e ainda a toupeira Speckles (Nicolas Cage). Juntos eles precisam deter os planos de um ambicioso bilionário, que deseja dominar o mundo através de eletrodomésticos.","first_air_date":"2009-07-24","runtime":88,"episode_run_time":[88],"vote_average":5.5,"created_by":["Walt Disney Pictures","Jerry Bruckheimer Films","Whamaphram Productions"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Jerry Bruckheimer Films"},{"name":"Whamaphram Productions"}],"cast":["Sam Rockwell","Jon Favreau","Tracy Morgan","Penélope Cruz","Nicolas Cage"],"backdrop_path":"https://image.tmdb.org/t/p/original/xgic8uEqzzhc0YimHGsWSQWMduE.jpg","poster_path":"https://image.tmdb.org/t/p/original/mebBWpOzmwEwdMfcQV8NjKXL5Ff.jpg","certification":"L","genres":["Animação","Família","Fantasia","Ação","Aventura","Comédia"],"trailer":"N/A"},
