"553839":{"id":"553839","name":"Saga of Tanya the Evil: O Filme","slug":"saga-of-tanya-the-evil-o-filme","original_title":"劇場版 幼女戦記","overview":"Ano de 1926 UC. O 203º Batalhão de Magos Aéreos do Exército Imperial, liderados pela Major Tanya Degurechaff, venceu a batalha do sul contra os dissidentes da República. Ansiosos por descansar após a vitória, o batalhão recebe ordens especiais do Quartel-General assim que chegam de viagem, alertando-os de sinais de uma mobilização em larga escala perto da fronteira com a Federação. Diante de um possível inimigo de peso, o desesperado Império atiça as chamas da guerra. Enquanto isso, desembarca na Federação um exército internacional de voluntários, liderado pela Comunidade das Nações.","first_air_date":"2019-02-08","runtime":116,"episode_run_time":[116],"vote_average":8.1,"created_by":["NUT"],"production_companies":[{"name":"NUT"}],"cast":["Aoi Yuki","Saori Hayami","Shin'ichirō Miki","Tessyo Genda","Hochu Otsuka"],"backdrop_path":"https://image.tmdb.org/t/p/original/dMcaQp4XfPK11bDeUyj2JOqEY8I.jpg","poster_path":"https://image.tmdb.org/t/p/original/8vuQngrdp2osdMXw8pBawJfF4Xg.jpg","certification":"16","genres":["Animação","Ação","Guerra","Fantasia"],"trailer":"N/A"},
"114478":{"id":"114478","name":"Tropas Estelares: A Invasão","slug":"tropas-estelares-a-invasao","original_title":"Starship Troopers: Invasion","overview":"O distante posto avançado da Federação, Fort Casey, é atacado por insetos. A equipe da nave Alesia recebe a missão de ajudar a nave John A. Warden que está em Fort Casey à evacuar, juntamente com os sobreviventes e trazer a inteligência militar em segurança de volta à Terra. Carl Jenkins, ministro da Paranormal Warfare, leva a nave numa missão clandestina antes de seu encontro com o Alesia e desaparece na nebulosa. Agora, os soldados veteranos são enviados em uma missão de resgate que pode levar a consequências muito mais sinistras do que jamais poderiam ter imaginado.","first_air_date":"2012-08-28","runtime":99,"episode_run_time":[99],"vote_average":5.9,"created_by":["Sola Digital Arts","Stage 6 Films"],"production_companies":[{"name":"Sola Digital Arts"},{"name":"Stage 6 Films"}],"cast":["Luci Christian","David Anthony Matranga","Justin Doran","David Wald","Andrew Love"],"backdrop_path":"https://image.tmdb.org/t/p/original/sFfD1TvTUzmzWFpSm7GnYrKcWJH.jpg","poster_path":"https://image.tmdb.org/t/p/original/hHDNShZLOEPgtGsoOCeQkRQ7mUN.jpg","certification":"16","genres":["Animação","Ação","Ficção científica"],"trailer":"N/A"},
"15969":{"id":"15969","name":"Aladdin - O Retorno de Jafar","slug":"aladdin-o-retorno-de-jafar","original_title":"The Return of Jafar","overview":"Por mais que parecesse impossível, o cruel feiticeiro Jafar – que se torna o gênio mais poderoso de todos os tempos – escapa da lâmpada em que era prisioneiro e tem um único objetivo: vingar-se de Aladdin. Agora, junto com a princesa Jasmine, Abu, o Tapete Mágico e o Gênio, Aladdin deverá enfrentar desafios como perigosos ladrões em cavalos voadores e chamas ameaçadoras em um lago de lava.","first_air_date":"1994-05-20","runtime":71,"episode_run_time":[71],"vote_average":6.2,"created_by":["Disney Television Animation"],"production_companies":[{"name":"Disney Television Animation"}],"cast":["Scott Weinger","Linda Larkin","Jonathan Freeman","Gilbert Gottfried","Dan Castellaneta"],"backdrop_path":"https://image.tmdb.org/t/p/original/mOOJm3tamy9iHg2mOEA77CM6ufZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/f7cOd8UI3QJepdIU26Pi300fjs3.jpg","certification":"L","genres":["Família","Aventura","Animação","Romance"],"trailer":"N/A"},
"113594":{"id":"113594","name":"Sammy: A Grande Fuga","slug":"sammy-a-grande-fuga","original_title":"A Turtle's Tale 2: Sammy's Escape from Paradise","overview":"Amigos desde a infância, as tartarugas marinhas Sammy e Ray vão tocando suas longas vidas numa boa até o dia em que seus netinhos recém nascidos correm perigo e todos acabam sendo capturados juntos. Durante o trajeto para Dubai, os dois pequenos conseguem fugir, mas os adultos acabam indo parar dentro de um imenso aquário, servindo de atração a milhares de turistas. Lá dentro, o espaço é comandado pelo cavalo marinho Big Boss, um cara marrento que vive inventando uns planos de fuga que acabam não dando certo, mas tartaruguinhas são espertas e com os novos amigos que fizeram do lado de fora da \"prisão\" vão tentar ajudar seus avôs a escapar dos seres humanos que os prenderam. Será que a ideia das pequeninas vai realmente funcionar?","first_air_date":"2012-08-01","runtime":92,"episode_run_time":[92],"vote_average":5.8,"created_by":["nWave Pictures","uFilm","StudioCanal","Around the World in 50 Years","Paradis Films","Eagle Pictures","Anton Capital Entertainment","Canal+","Illuminata Pictures"],"production_companies":[{"name":"nWave Pictures"},{"name":"uFilm"},{"name":"StudioCanal"},{"name":"Around the World in 50 Years"},{"name":"Paradis Films"},{"name":"Eagle Pictures"},{"name":"Anton Capital Entertainment"},{"name":"Canal+"},{"name":"Illuminata Pictures"}],"cast":["Kaitlyn Maher","Carter Hastings","Alan Shearman","Khary Payton","Carlos Alazraqui"],"backdrop_path":"https://image.tmdb.org/t/p/original/oouy3ZkF1yNAHyicANcp70uqfSj.jpg","poster_path":"https://image.tmdb.org/t/p/original/1pqJ7jN247L9loMwi0iaSvKt8RX.jpg","certification":"A","genres":["Aventura","Animação","Família"],"trailer":"N/A"},
"631132":{"id":"631132","name":"Matador de Goblins: A Coroa do Goblin","slug":"matador-de-goblins-a-coroa-do-goblin","original_title":"ゴブリンスレイヤー -GOBLIN'S CROWN-","overview":"\"Por favor, descubram alguma pista sobre a Nobre Esgrimista que desapareceu ao partir para matar uns goblins.\" Ao receber um pedido da Donzela da Espada, o Matador de Goblins e seu bando seguem para as montanhas nevadas do norte. Uma pequena vila é atacada, eles descobrem uma misteriosa capela, e algo no comportamento dos goblins intriga o Matador de Goblins. \"Eu vou recuperar tudo que eu perdi!\" Para salvar a Nobre Esgrimista sequestrada, o grupo do Matador de Goblins marcha rumo a uma antiga fortaleza coberta de neve, prestes a se digladiar contra um poderoso inimigo e uma horda de goblins!","first_air_date":"2020-02-01","runtime":85,"episode_run_time":[85],"vote_average":7.4,"created_by":["White Fox"],"production_companies":[{"name":"White Fox"}],"cast":["Yuichiro Umehara","小倉唯","Nao Toyama","Yuichi Nakamura","Tomokazu Sugita"],"backdrop_path":"https://image.tmdb.org/t/p/original/ySHlkHDbXztjdjRJ0pZN7FXRnaW.jpg","poster_path":"https://image.tmdb.org/t/p/original/d7fHUMv7L5m44JuwvBAaCXICJwb.jpg","certification":"N/A","genres":["Animação","Aventura","Ação","Fantasia"],"trailer":"SFMusDom-eo"},
