"290727":{"id":"290727","name":"Monster High: Monster Fusion","slug":"monster-high-monster-fusion","original_title":"Monster High: Freaky Fusion","overview":"Ao tentar ajudar Frankie a aprender mais sobre seus antepassados, as monstrinhas por descuido voltam no tempo para 1814, no primeiro dia de Monster High. Lá, elas encontram Sparky, um jovem cientista com uma obsessão por criar vida. Buscando descobrir o segredo que trouxe Frankie a vida, Sparky realiza uma série de experimentos no laboratório da escola, resultando na fusão de oito monstrinhas em quatro monstras misturadas. Sem saber controlar seus novos corpos, as monstrinhas precisam da ajuda de uma nova turma de monstros, os híbridos. Será que elas resolveram tudo a tempo de se apresentar no grande Show do Bicentenário?","first_air_date":"2014-10-06","runtime":73,"episode_run_time":[73],"vote_average":7.7,"created_by":["Mattel Playground Productions","Mattel","Nerd Corps Entertainment"],"production_companies":[{"name":"Mattel Playground Productions"},{"name":"Mattel"},{"name":"Nerd Corps Entertainment"}],"cast":["Haviland Stillwell","Laura Bailey","Paula Rhodes","Kate Higgins","America Young"],"backdrop_path":"https://image.tmdb.org/t/p/original/tg0aXAvX4qKCkpPQImNEE0e90Pf.jpg","poster_path":"https://image.tmdb.org/t/p/original/rZLksXFruhQYUXzCgixkB9y2ms5.jpg","certification":"L","genres":["Animação"],"trailer":"N/A"},
"449574":{"id":"449574","name":"Godzilla: Planeta dos Monstros","slug":"godzilla-planeta-dos-monstros","original_title":"GODZILLA 怪獣惑星","overview":"No século XX, a humanidade soube da existência do Godzilla e, após diversas derrotas, fez um plano para sair da terra e habitar outro planeta. Porém, os cálculos estavam errados e após uma viagem de 20 anos, os humanos perceberam que o planeta escolhido não tinha condições para a vida. O protagonista da trama é Haruo, que viu seus pais serem mortos pelo Godzilla quando tinha 4 anos e agora só quer voltar para a Terra e derrotar o animal. Ao voltarem, no entanto, já se passaram 20.000 anos na Terra, que agora tem seu ecossistema controlado pelo Godzilla.","first_air_date":"2017-11-17","runtime":89,"episode_run_time":[89],"vote_average":6.4,"created_by":["Polygon Pictures","TOHO"],"production_companies":[{"name":"Polygon Pictures"},{"name":"TOHO"}],"cast":["Mamoru Miyano","Takahiro Sakurai","Kana Hanazawa","Tomokazu Sugita","Yuki Kaji"],"backdrop_path":"https://image.tmdb.org/t/p/original/5QAc8dsyOwJBGQ71mhOLMEivOsF.jpg","poster_path":"https://image.tmdb.org/t/p/original/91x2fzJSRokwpv4z5CmfLd36B4u.jpg","certification":"12","genres":["Animação","Ação","Ficção científica"],"trailer":"N/A"},
