"20558":{"id":"20558","name":"Scooby-Doo! em Cadê a minha Múmia","slug":"scooby-doo-em-cade-a-minha-mumia","original_title":"Scooby-Doo! in Where's My Mummy?","overview":"A arqueologista e super detetive Velma está no Egito para a cerimônia de reabertura à visitação da recém reformatada Esfinge - uma misteriosa e mítica criatura com a cabeça de homem e o corpo de leão - e acaba descobrindo nada menos que uma tumba pertencente à Rainha Cleópatra. Mas tem que tomar cuidado com a maldição do faraó: \"O Nilo vai se tornar deserto e todos que aqui entrarem tornar-se-ão pedra!\". Claro que o aviso não é suficiente para impedir que Scooby-Doo e a Mistério S/A de adentrarem a tumba e encontrarem algo ainda mais aterrorizante: um amaldiçoado exército de mortos-vivos! Então, sente-se confortavelmente e testemunhe a mais espetacular aventura de Scooby-Doo até os dias de hoje.","first_air_date":"2005-05-13","runtime":75,"episode_run_time":[75],"vote_average":7.4,"created_by":["Warner Bros. Animation"],"production_companies":[{"name":"Warner Bros. Animation"}],"cast":["Casey Kasem","Frank Welker","Mindy Cohn","Grey DeLisle","Christine Baranski"],"backdrop_path":"https://image.tmdb.org/t/p/original/aAjxXJ83roDq1Ky9NaHGyHWSDHa.jpg","poster_path":"https://image.tmdb.org/t/p/original/8iDT42lz3rtrdt21ZbRtJbCUml.jpg","certification":"N/A","genres":["Mistério","Animação","Família","Aventura","Comédia","Fantasia"],"trailer":"N/A"},
