"580600":{"id":"580600","name":"Astro Kid","slug":"astro-kid","original_title":"Terra Willy, planète inconnue","overview":"O jovem Willy se perde de seus pais depois que a nave espacial deles é destruída por uma chuva de meteoros. Sua cápsula aterriza em um planeta selvagem e inexplorado, e Willy deve aprender a sobreviver nele. Graças à ajuda de Buck, um robô de sobrevivência, ele espera até a chegada da missão de resgate enquanto descobre a fauna, a flora e também os perigos do planeta com seu novo amigo alienígena, Flash.","first_air_date":"2019-04-03","runtime":86,"episode_run_time":[86],"vote_average":7.2,"created_by":["Logical Pictures","TAT Productions","Bac Films","France 3 Cinéma","Master Films","Viva Kids","CNC","France Télévisions","OCS","PROCIREP","ANGOA","SDI media","Eclair","Ciné+","Cofiloisirs Film France Solutions","Yellow Cab Studios","Sacem","Région Occitanie"],"production_companies":[{"name":"Logical Pictures"},{"name":"TAT Productions"},{"name":"Bac Films"},{"name":"France 3 Cinéma"},{"name":"Master Films"},{"name":"Viva Kids"},{"name":"CNC"},{"name":"France Télévisions"},{"name":"OCS"},{"name":"PROCIREP"},{"name":"ANGOA"},{"name":"SDI media"},{"name":"Eclair"},{"name":"Ciné+"},{"name":"Cofiloisirs Film France Solutions"},{"name":"Yellow Cab Studios"},{"name":"Sacem"},{"name":"Région Occitanie"}],"cast":["Timothé Vom Dorp","Édouard Baer","Marie-Eugénie Maréchal","Guillaume Lebon","Barbara Tissier"],"backdrop_path":"https://image.tmdb.org/t/p/original/ivKorzMwX7ZEWtJozRn6Q3VgZgO.jpg","poster_path":"https://image.tmdb.org/t/p/original/2WjImKh2iXGFRuteLzXU782MJ6l.jpg","certification":"N/A","genres":["Animação","Comédia","Aventura","Família"],"trailer":"v_h5MmK9V00"},
