"13932":{"id":"13932","name":"O Ataque de Zezé","slug":"o-ataque-de-zeze","original_title":"Jack-Jack Attack","overview":"Kari, a babá, acha que vai passar uma noite de babá de rotina. Ela está preparada para fornecer estímulo neurológico com algum acompanhamento musical suave para o pequeno Zezé, o menor membro da incrível família Pera. Mal ela sabe que Zezé lhe ensinará uma coisa ou duas sobre bebês com \"necessidades especiais\". Fiel à sua palavra, Kari prova que pode lidar com qualquer coisa que Zezé possa dizer – apenas por pouco. E Zezé prova que ouvir Mozart realmente torna os bebês mais inteligentes.","first_air_date":"2005-03-15","runtime":5,"episode_run_time":[5],"vote_average":7.3,"created_by":["Pixar","Walt Disney Pictures"],"production_companies":[{"name":"Pixar"},{"name":"Walt Disney Pictures"}],"cast":["Bret Parker","Bud Luckey","Eli Fucile","Jason Lee"],"backdrop_path":"https://image.tmdb.org/t/p/original/4IwoBJFfg24wNGD7A77XdSEXNLT.jpg","poster_path":"https://image.tmdb.org/t/p/original/6m3oBLhUs0Yl9jIwwrbdzb5GHj9.jpg","certification":"L","genres":["Aventura","Animação","Família"],"trailer":"N/A"},
"396330":{"id":"396330","name":"LEGO Super Heroes: DC Liga da Justiça - Revolta em Gotham","slug":"lego-super-heroes-dc-liga-da-justica-revolta-em-gotham","original_title":"LEGO DC Comics Super Heroes: Justice League - Gotham City Breakout","overview":"O combate ao crime é um trabalho em tempo integral e Batman nunca tira férias. Isso até quando ele finalmente concorda em deixar Batgirl e Asa Noturna levá-lo para uma merecida viagem – deixando a cidade de Gotham sob os olhares atentos da Liga da Justiça. Mas Batman está longe de tirar um descanso quando o trio encontra um velho inimigo em sua aventura, e a Liga da Justiça descobre o quão ocupado Batman fica no dia a dia.","first_air_date":"2016-06-21","runtime":78,"episode_run_time":[78],"vote_average":6.7,"created_by":["Warner Bros. Animation","DC Entertainment","LEGO"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"},{"name":"LEGO"}],"cast":["Troy Baker","Eric Bauza","Greg Cipes","John DiMaggio","Will Friedle"],"backdrop_path":"https://image.tmdb.org/t/p/original/heHlmq6MPp5SdZSvUApCEXDfOBs.jpg","poster_path":"https://image.tmdb.org/t/p/original/oqw58OeHHqqn9N1vsh52GP7LZIH.jpg","certification":"L","genres":["Animação","Família","Aventura","Ação","Comédia"],"trailer":"N/A"},
"15016":{"id":"15016","name":"Barbie: Lago dos Cisnes","slug":"barbie-lago-dos-cisnes","original_title":"Barbie of Swan Lake","overview":"Baseado na música de Tchaikovsky e no adorado conto de fadas, o filme traz Barbie como Odette, a jovem filha do padeiro que segue um unicórnio até a Floresta Encantada. O malvado feiticeiro Rodrigo – que pretende derrotar sua prima a Fada e tomar a Floresta, transforma Odette em cisne. A Fada Rainha consegue amenizar o feitiço fazendo com que Odette seja humana à noite e cisne de dia. Odette percebe que, mesmo que sinta ser a pessoa errada para a tarefa, é seu destino salvar a Floresta Encantada. Mas como pode uma garota armada apenas de sua coragem, honestidade e inteligência conseguir isso, tudo enquanto o belo Príncipe Daniel se apaixona por ela?","first_air_date":"2003-09-27","runtime":81,"episode_run_time":[81],"vote_average":7.0,"created_by":["Mainframe Entertainment","Mattel"],"production_companies":[{"name":"Mainframe Entertainment"},{"name":"Mattel"}],"cast":["Kelly Sheridan","Mark Hildreth","Kelsey Grammer","Maggie Wheeler","Venus Terzo"],"backdrop_path":"https://image.tmdb.org/t/p/original/tonrulTmO9ZyZmsAsr5yr9ciE4c.jpg","poster_path":"https://image.tmdb.org/t/p/original/oOIdyQDj06G8V6AHQl4I7i1UCTT.jpg","certification":"N/A","genres":["Animação","Família"],"trailer":"N/A"},
