"196750":{"id":"196750","name":"Ghost in the Shell Arise: Limite 1 - Dor Fantasma","slug":"ghost-in-the-shell-arise-limite-1-dor-fantasma","original_title":"攻殻機動隊ARISE border: 1 Ghost Pain","overview":"A história do anime se passa em 2027, um ano após o final da quarta guerra não-nuclear. New Port City ainda está se recuperando do pós-guerra, quando ela sofre um atentado provocado por uma mina automotor. Em seguida, um membro de uma unidade militar é morto a tiros. Durante a investigação, a Segurança Pública da Seção Daisuke Aramaki encontra Motoko Kusanagi, a cyborg hacker atribuída a unidade secreta 501 dos militares. Batou, um homem com o \"olho que não dorme\", suspeita que Kusanagi é a pessoa por trás do atentado. O Polícial detetive Togusa de Niihama está perseguindo seus próprios casos duais da morte a tiros e assassinato de uma prostituta. Motoko está sendo vigiada por Kurutsu, cabeça da unidade secreta do 501 e os agentes ciborgues.","first_air_date":"2013-06-22","runtime":60,"episode_run_time":[60],"vote_average":7.1,"created_by":["Bandai Visual","TOHO","Production I.G","Kodansha"],"production_companies":[{"name":"Bandai Visual"},{"name":"TOHO"},{"name":"Production I.G"},{"name":"Kodansha"}],"cast":["Maaya Sakamoto","塾一久","Kenichirou Matsuda","Kazuya Nakai","咲野俊介"],"backdrop_path":"https://image.tmdb.org/t/p/original/uDcs9eKcNgPadTlxuG0O3wzdkjt.jpg","poster_path":"https://image.tmdb.org/t/p/original/3ldgWVSZJO5QUzAXNZAPd0C18uF.jpg","certification":"N/A","genres":["Ação","Animação","Crime","Ficção científica"],"trailer":"N/A"},
"9836":{"id":"9836","name":"Happy Feet: O Pinguim","slug":"happy-feet-o-pinguim","original_title":"Happy Feet","overview":"Os pinguins imperadores nasceram para cantar. Todos eles, a não ser o jovem Mano, que parece ter nascido para sapatear... Esse comportamento pouco comum para um pinguim acaba cavando a saída de Mano da Terra do Imperador e o lança em um mundo enorme e frio. Acompanhado por amigos e por um bando de pinguins diferentes liderados pelo divertido Amoroso. Mano embarca em uma jornada épica e definitiva para sua vida, que prova que sendo fiel aquilo que acredita, qualquer pessoa pode fazer diferença no mundo.","first_air_date":"2006-11-16","runtime":108,"episode_run_time":[108],"vote_average":6.2,"created_by":["Kennedy Miller Productions","Animal Logic","Village Roadshow Pictures"],"production_companies":[{"name":"Kennedy Miller Productions"},{"name":"Animal Logic"},{"name":"Village Roadshow Pictures"}],"cast":["Elijah Wood","Robin Williams","Brittany Murphy","Hugh Jackman","Nicole Kidman"],"backdrop_path":"https://image.tmdb.org/t/p/original/pxsR974ez8bQx0GDixxiKr7pk1o.jpg","poster_path":"https://image.tmdb.org/t/p/original/vd5OoU5rhfKblLoLwaCK5QU0yJS.jpg","certification":"L","genres":["Animação","Comédia","Família"],"trailer":"N/A"},
"471474":{"id":"471474","name":"Gotham City 1889: Um Conto de Batman","slug":"gotham-city-1889-um-conto-de-batman","original_title":"Batman: Gotham by Gaslight","overview":"Gotham, na virada do século, está passando por uma época de descoberta e indústria, mas nos becos mais sombrios há um assassino à solta. Trabalhando juntos, Batman e o comandante da Polícia James Gordon tentam capturar o temível Jack, o Estripador.","first_air_date":"2018-01-12","runtime":77,"episode_run_time":[77],"vote_average":6.7,"created_by":["Warner Bros. Animation","DC Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"}],"cast":["Bruce Greenwood","Jennifer Carpenter","Anthony Stewart Head","Scott Patterson","John DiMaggio"],"backdrop_path":"https://image.tmdb.org/t/p/original/9ojJB7vZR2uDqXdxOzYaADthEBT.jpg","poster_path":"https://image.tmdb.org/t/p/original/TpcNor0WkmD1SBO3n3tlkQqmOf.jpg","certification":"16","genres":["Thriller","Ação","Animação","Ficção científica"],"trailer":"N/A"},
"30575":{"id":"30575","name":"Bishoujo Senshi Sailor Moon S: Hearts in Ice","slug":"bishoujo-senshi-sailor-moon-s-hearts-in-ice","original_title":"劇場版 美少女戦士セーラームーンS 〜かぐや姫の恋人〜","overview":"Um meteoro gelado vaga de maneira ameaçadora acima da Terra. A rainha da neve envia cristais ao planeta, instrumentos importantes para seu plano de congelar o planeta e destruir toda a vida. Entrretanto, um cristal foi encontrado por um inocente astrônomo, cuja vida agora se encontra em perigo. Podem as sailors ajudar o astrônomo e derrotar a rainha da neve antes que seja demasiado tarde?","first_air_date":"1994-12-04","runtime":60,"episode_run_time":[60],"vote_average":7.7,"created_by":["TV Asahi","Toei Animation"],"production_companies":[{"name":"TV Asahi"},{"name":"Toei Animation"}],"cast":["三石琴乃","久川綾","富沢美智恵","篠原恵美","深見梨加"],"backdrop_path":"https://image.tmdb.org/t/p/original/Z4FW54wpXHcYKpCOY0OGhYwQ1I.jpg","poster_path":"https://image.tmdb.org/t/p/original/uhVhhdIaRzLY3btUeBsBQU51S97.jpg","certification":"N/A","genres":["Animação","Fantasia","Ação","Romance","Comédia"],"trailer":"N/A"},
