"445030":{"id":"445030","name":"No Game No Life: Zero","slug":"no-game-no-life-zero","original_title":"ノーゲーム・ノーライフ ゼロ","overview":"Seis mil anos antes de Sora e Shiro chegarem a Disboard, a guerra consumiu a terra, rasgando os céus, destruindo estrelas e até ameaçando acabar com a raça humana. Em meio ao caos e à destruição, um jovem chamado Riku lidera a humanidade rumo ao amanhã em que seu coração acredita. Um dia, nas ruínas de uma cidade élfica, ele conhece Schwi, uma androide “Ex Machina” exilada que pede a ele que lhe ensine o que significa ter um coração humano.","first_air_date":"2017-07-15","runtime":106,"episode_run_time":[106],"vote_average":7.8,"created_by":["Madhouse","AT-X","KADOKAWA","movic","Sentai Filmworks","Frontier Works"],"production_companies":[{"name":"Madhouse"},{"name":"AT-X"},{"name":"KADOKAWA"},{"name":"movic"},{"name":"Sentai Filmworks"},{"name":"Frontier Works"}],"cast":["Yoko Hikasa","Ai Kayano","Yoshitsugu Matsuoka","Kazuyuki Okitsu","Ryota Takeuchi"],"backdrop_path":"https://image.tmdb.org/t/p/original/ajUegP5L21iB8mXWl938o5TS6Hv.jpg","poster_path":"https://image.tmdb.org/t/p/original/aC2u68gvupS5gD3tOSAKg8jhd9T.jpg","certification":"N/A","genres":["Aventura","Animação","Drama","Fantasia","Romance"],"trailer":"N/A"},
