"17710":{"id":"17710","name":"Hey Arnold! O Filme","slug":"hey-arnold-o-filme","original_title":"Hey Arnold! The Movie","overview":"O heroí da Nickelodeon, com cabeça em formato de bola de futebol americano, invade a tela, nesta deliciosa e divertida aventura pra toda a família. Um desalmado industrial tem um plano diabólico: demolir o bairro de Arnold e construir um enorme shopping center. com o tempo correndo, alguém tem que salvar a pátria. E esse alguém é Arnold. Junto com Helga, sua inimiga de maria-chiquinhas, que secretamente é apaixonada por ele, e Gerald, seu melhor amigo, Arnold toma uma atitude para provar qual o verdadeiro sentido da palavra progresso: encontrando novas diversões no velho bairro, que ele chama de \"lar\". Apresentando o talento das vozes de: Jennifer Jason Leigh, Paul Sorvino e Christopher Lloyd, na versão em inglês, este filme é \"... um prêmio para todas as idades!\"","first_air_date":"2002-06-28","runtime":76,"episode_run_time":[76],"vote_average":6.5,"created_by":["Paramount Pictures","Nickelodeon Movies","Snee-Oosh Productions","Nickelodeon Animation Studio"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Nickelodeon Movies"},{"name":"Snee-Oosh Productions"},{"name":"Nickelodeon Animation Studio"}],"cast":["Spencer Klein","Francesca Marie Smith","Jamil Walker Smith","Dan Castellaneta","Tress MacNeille"],"backdrop_path":"https://image.tmdb.org/t/p/original/1pEMcogCLU2z9s3Vl10UUKswLLk.jpg","poster_path":"https://image.tmdb.org/t/p/original/xbLyR7nVeZSnUKtQHsytgfcfZtM.jpg","certification":"N/A","genres":["Animação","Comédia","Família"],"trailer":"N/A"},
