"13851":{"id":"13851","name":"Batman: O Cavaleiro de Gotham","slug":"batman-o-cavaleiro-de-gotham","original_title":"Batman: Gotham Knight","overview":"Dos produtores de Batman Begins e de Batman – O Cavaleiro das Trevas, o grande lançamento de cinema do ano, vem esta maravilhosa interpretação da transição do Homem-Morcego, de inciante à Cavaleiro das Trevas. Seis histórias interrelacionadas revelam as primeiras aventuras de Bruce Wayne como Batman e os passos que ele tomou até se transformar no incansável vingador de Gotham City. Estas incríveis aventuras colocam Batman contra o amedrontador Espantalho e dois outros vilões jamais encarados antes: o ensandecido Killer Croc e o pistoleiro que nunca erra conhecido como Deadshot","first_air_date":"2008-07-08","runtime":75,"episode_run_time":[75],"vote_average":6.7,"created_by":["DC","BeeTrain","Warner Bros. Animation","Madhouse","Production I.G","STUDIO4℃","Warner Bros. Japan"],"production_companies":[{"name":"DC"},{"name":"BeeTrain"},{"name":"Warner Bros. Animation"},{"name":"Madhouse"},{"name":"Production I.G"},{"name":"STUDIO4℃"},{"name":"Warner Bros. Japan"}],"cast":["Kevin Conroy","Jason Marsden","Scott Menville","George Newbern","Corey Padnos"],"backdrop_path":"https://image.tmdb.org/t/p/original/niRgVCgvDVxD67u6gjKZnkBO1AD.jpg","poster_path":"https://image.tmdb.org/t/p/original/bbLZlFl1K8EzkoXcZ0a8bBRZIAu.jpg","certification":"14","genres":["Ficção científica","Animação","Ação","Crime","Thriller"],"trailer":"N/A"},
"230222":{"id":"230222","name":"Tarzan: A Evolução da Lenda","slug":"tarzan-a-evolucao-da-lenda","original_title":"Tarzan","overview":"Após seus pais serem mortos, um bebê é criado por uma gorila, que passa a tratá-lo como se fosse seu filho. Ao crescer ele se torna Tarzan (Kellan Lutz), o rei da selva. É quando precisa enfrentar um exército de mercenários enviado à floresta por um malvado executivo da Greystoke Energies, a empresa que um dia pertenceu aos pais de Tarzan. Para enfrentá-los ele conta com a ajuda de Jane Porter (Spencer Locke), uma jovem que chega à floresta após um acidente no avião em que estava.","first_air_date":"2013-10-17","runtime":94,"episode_run_time":[94],"vote_average":5.7,"created_by":["Ambient Entertainment","Constantin Film","Summit Entertainment"],"production_companies":[{"name":"Ambient Entertainment"},{"name":"Constantin Film"},{"name":"Summit Entertainment"}],"cast":["Kellan Lutz","Spencer Locke","Les Bubb","Joe Cappelletti","Brian Huskey"],"backdrop_path":"https://image.tmdb.org/t/p/original/7KiBr9MNqcNNJKj6FkEGfNHSAsH.jpg","poster_path":"https://image.tmdb.org/t/p/original/su68nrElPaykcVGJpklNK3Tpd8F.jpg","certification":"L","genres":["Animação","Ação","Aventura","Família"],"trailer":"N/A"},
"366924":{"id":"366924","name":"Batman: Sangue Ruim","slug":"batman-sangue-ruim","original_title":"Batman: Bad Blood","overview":"O manto do Batman passa para as mãos de Dick Grayson quando Bruce Wayne desaparece misteriosamente. Alfred cobre o sumiço do patrão enquanto o Asa Noturna e o Robin patrulham Gotham City. Uma nova personagem surge na história, a Batwoman, que está investigando o desaparecimento do Batman.","first_air_date":"2016-01-19","runtime":72,"episode_run_time":[72],"vote_average":7.0,"created_by":["Warner Bros. Animation","DC Entertainment"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC Entertainment"}],"cast":["Jason O'Mara","Yvonne Strahovski","Stuart Allan","Sean Maher","Morena Baccarin"],"backdrop_path":"https://image.tmdb.org/t/p/original/jLslJietfQJEgOvQHk4fRYFCnTS.jpg","poster_path":"https://image.tmdb.org/t/p/original/ngM7Ht2Tt5sEr8CgEPAbrk4vxSp.jpg","certification":"12","genres":["Ficção científica","Ação","Animação","Aventura","Crime"],"trailer":"N/A"},
"24556":{"id":"24556","name":"Em Busca do Vale Encantado XI: A Invasão dos Minissauros","slug":"em-busca-do-vale-encantado-xi-a-invasao-dos-minissauros","original_title":"The Land Before Time XI: Invasion of the Tinysauruses","overview":"Desta vez, os Minissauros, invadem o Vale Encantado para ensinarem a Littlefoot uma grande lição sobre uma pequena mentira. Conhece os seus novos e pequenos amigos e canta novas músicas. A Invasão dos Minissauros mostra que os heróis, amigos e famílias podem ser de todos os feitios e tamanhos! Littlefoot descobre que até uma pequena mentira pode causar um grande problema.","first_air_date":"2005-01-11","runtime":80,"episode_run_time":[80],"vote_average":6.3,"created_by":["Universal Animation Studios","Universal Cartoon Studios"],"production_companies":[{"name":"Universal Animation Studios"},{"name":"Universal Cartoon Studios"}],"cast":["Aaron Spann","Jeff Bennett","Aria Noelle Curzon","Anndi McAfee","Rob Paulsen"],"backdrop_path":"https://image.tmdb.org/t/p/original/hpDimUxwxtBcU7zyYRoieCe8fVJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/ozRfPkimgp4zmH9hnPNT1Waxvnm.jpg","certification":"L","genres":["Animação","Família","Fantasia","Aventura"],"trailer":"N/A"},
