"442056":{"id":"442056","name":"Meu Amigo Vampiro","slug":"meu-amigo-vampiro","original_title":"The Little Vampire 3D","overview":"Entendiado em seu 13º aniversário pelo 300º ano, o vampiro Rudolph decidiu iniciar uma ousada aventura: vai para o mundo real dos humanos buscar por novidades. Lá, onde apenas pessoas vivas têm espaço, ele vai começar uma amizade improvável com Tony, um adolescente de 12 anos apaixonado por lendas vampirescas. Mas o que ele não imagina é que Roque, um caçador, pretender capturá-lo a qualquer custo.","first_air_date":"2017-10-04","runtime":80,"episode_run_time":[80],"vote_average":6.1,"created_by":["A. Film Production","Ambient Entertainment","Cool Beans","Rothkirch Cartoon Film"],"production_companies":[{"name":"A. Film Production"},{"name":"Ambient Entertainment"},{"name":"Cool Beans"},{"name":"Rothkirch Cartoon Film"}],"cast":["Rasmus Hardiker","Amy Saville","Jim Carter","Joseph Kloska","Phoebe Givron-Taylor"],"backdrop_path":"https://image.tmdb.org/t/p/original/vZw7cUeCj0n0o9hmubL0rSUYEhM.jpg","poster_path":"https://image.tmdb.org/t/p/original/zhsPZXCBwt2fL8GoQtmLIomVRpA.jpg","certification":"N/A","genres":["Comédia","Animação","Família","Fantasia"],"trailer":"N/A"},
"9606":{"id":"9606","name":"Metrópolis","slug":"metropolis","original_title":"メトロポリス","overview":"Metrópolis é uma grande cidade do futuro, onde convivem homens e robôs. A civilização atingiu um outro estágio e as sociedades estão absolutamente segmentadas. É neste cenário que o detetive Syunsaku Ban e seu parceiro Kenichi procuram pelo Dr. Laughton. A dupla quer não só prender o cientista, como também se apoderar de Tima, a jovem robô criada por ele.","first_air_date":"2001-05-26","runtime":108,"episode_run_time":[108],"vote_average":7.1,"created_by":["Bandai Visual","Destination Films","TOHO","dentsu Music And Entertainment","King Records","Sony Pictures Television","Metropolis Project","Madhouse","KADOKAWA Shoten","Tezuka Productions","IMAGICA","STUDIO4℃"],"production_companies":[{"name":"Bandai Visual"},{"name":"Destination Films"},{"name":"TOHO"},{"name":"dentsu Music And Entertainment"},{"name":"King Records"},{"name":"Sony Pictures Television"},{"name":"Metropolis Project"},{"name":"Madhouse"},{"name":"KADOKAWA Shoten"},{"name":"Tezuka Productions"},{"name":"IMAGICA"},{"name":"STUDIO4℃"}],"cast":["Kei Kobayashi","井元由香","岡田浩暉","石田太郎","富田耕生"],"backdrop_path":"https://image.tmdb.org/t/p/original/1FBByew9RnXQ2HFqf7b6EWkyzTP.jpg","poster_path":"https://image.tmdb.org/t/p/original/4XbTJgz5zADYp4fX6DbdhZga39q.jpg","certification":"14","genres":["Animação","Ficção científica"],"trailer":"N/A"},
"71689":{"id":"71689","name":"Phineas e Ferb: O Filme: Através da 2ª Dimensão","slug":"phineas-e-ferb-o-filme-atraves-da-2-dimensao","original_title":"Phineas and Ferb The Movie: Across the 2nd Dimension","overview":"Phineas e Ferb descobrem que seu amado animal de estimação Perry,o Onitorrinco é um agente secreto que luta contra as forças do mal quase todos os dias. Os meninos, com Perry vão entrar em uma grande aventura através de um universo paralelo onde eles devem, em última instância contrariar uma versão mais malvada do Dr. Doofenshmirtz. Enquanto isso Candace tenta equilibrar amigos com seu namorado.","first_air_date":"2011-08-05","runtime":78,"episode_run_time":[78],"vote_average":7.1,"created_by":["Disney Television Animation"],"production_companies":[{"name":"Disney Television Animation"}],"cast":["Vincent Martella","Thomas Brodie-Sangster","Dee Bradley Baker","Ashley Tisdale","Dan Povenmire"],"backdrop_path":"https://image.tmdb.org/t/p/original/uxezSInaPoH20CyHx4TuY1LzGly.jpg","poster_path":"https://image.tmdb.org/t/p/original/nSvJH6ledaE7Um5hbulNKD1wXzi.jpg","certification":"N/A","genres":["Animação","Comédia","Família","Cinema TV","Ficção científica","Aventura","Ação","Música"],"trailer":"B3dQObIcqzs"},
"164372":{"id":"164372","name":"O Reino Gelado","slug":"o-reino-gelado","original_title":"Снежная королева","overview":"Desejando criar um novo mundo no qual o vento polar esfrie as almas humanas, a Rainha da Neve cobriu o planeta com gelo e ordenou a destruição de todas as artes. De acordo com as previsões de um espelho mágico, a última ameaça aos seus planos estaria no mestre-vidreiro Vegard, cujos espelhos refletem não apenas a aparência, mas também as almas das pessoas. Então, o vento polar sequestra Vegard e sua esposa Una, deixando seus filhos Kai e Gerda para trás. O tempo passa e os servos da Rainha acabam capturando também Kai, acreditando que o garoto é o sucessor de seu pai. Mas sua irmã Gerda, agora uma garota muito corajosa, não vai deixar isso barato. Embarcando em uma jornada pelo reino, ela vai encarar todos os obstáculos ao lado de seus novos amigos para salvar o irmão e voltar a aquecer os corações das pessoas.","first_air_date":"2012-10-11","runtime":73,"episode_run_time":[73],"vote_average":5.8,"created_by":["Bazelevs Production","Voronezh Animation Studio"],"production_companies":[{"name":"Bazelevs Production"},{"name":"Voronezh Animation Studio"}],"cast":["Иван Охлобыстин","Дмитрий Нагиев","Людмила Артемьева","Анна Ардова","Елизавета Арзамасова"],"backdrop_path":"https://image.tmdb.org/t/p/original/gvCnzzk9QELPQNkR27p4W9uFFGV.jpg","poster_path":"https://image.tmdb.org/t/p/original/8hqdB3xYhvn1yC180n5vbthLGfb.jpg","certification":"L","genres":["Animação","Fantasia","Família"],"trailer":"N/A"},
