"296917":{"id":"296917","name":"Psycho-Pass: Filme","slug":"psycho-pass-filme","original_title":"劇場版 サイコパス","overview":"No ano 2116, o governo japonês começa a exportar o “Sistema Sybil” e seus drones não tripulados para vários países em crise em todo o mundo. Um país no meio de uma guerra civil, SEAUn (União dos Países do Leste Asiático) utiliza o Sybil como um experimento. Com o novo sistema, a cidade costeira de Shambala Float alcança paz e a segurança temporária. Mas quando terroristas de SEAUn são enviados para o Japão e atacam o sistema central de Sybil por dentro, um policial de Shambala Float, Tsunemori, viaja para investigar o incidente. No Japão ele procura entender a verdadeira justiça neste novo território.","first_air_date":"2015-01-09","runtime":114,"episode_run_time":[114],"vote_average":7.1,"created_by":["Production I.G","Fuji Television Network","TOHO","Sony Music Entertainment","Kyoraku Industrial Holdings","dentsu","Nitroplus"],"production_companies":[{"name":"Production I.G"},{"name":"Fuji Television Network"},{"name":"TOHO"},{"name":"Sony Music Entertainment"},{"name":"Kyoraku Industrial Holdings"},{"name":"dentsu"},{"name":"Nitroplus"}],"cast":["Kana Hanazawa","関智一","野島健児","Ayane Sakura","Takahiro Sakurai"],"backdrop_path":"https://image.tmdb.org/t/p/original/8jnHGZ4vguLcctDHlMvaAyG7mjb.jpg","poster_path":"https://image.tmdb.org/t/p/original/2nSak3UREboupBdzbolau3nkPAN.jpg","certification":"N/A","genres":["Animação","Ficção científica","Ação"],"trailer":"N/A"},
