"1207830":{"id":"1207830","name":"Pets em Ação!","slug":"pets-em-acao","original_title":"Gracie & Pedro: Pets to the Rescue","overview":"Gracie e Pedro não poderiam ser mais diferentes! Ela é uma cachorrinha de raça que acredita ser a melhor de todas, enquanto ele é um gato adotado que se contenta com aventuras nas ruas e até jantar do lixo. Apesar de serem da mesma família, eles não se suportam e vivem discutindo por qualquer coisinha. Durante uma viagem em família, eles acabam se perdendo no aeroporto e, agora, Gracie e Pedro precisam superar suas diferenças e unir forças para encontrar o caminho de volta para casa e para a família que tanto amam.","first_air_date":"2024-05-01","runtime":89,"episode_run_time":[89],"vote_average":6.4,"created_by":["Second Chance Productions","Luminescence","GTE Productions"],"production_companies":[{"name":"Second Chance Productions"},{"name":"Luminescence"},{"name":"GTE Productions"}],"cast":["Claire Alan","Cory Doran","Susan Sarandon","Brooke Shields","Alicia Silverstone"],"backdrop_path":"https://image.tmdb.org/t/p/original/AjTodtZJlQxycfRPktnUTpknblv.jpg","poster_path":"https://image.tmdb.org/t/p/original/15qZcDm6v9QB8Wcx8su3KNOPKH2.jpg","certification":"L","genres":["Animação","Aventura","Comédia","Família"],"trailer":"AwkCeEDDEsM"},
