"83564":{"id":"83564","name":"A Lua","slug":"a-lua","original_title":"La luna","overview":"Um menino se transforma em garoto na mais peculiar de circunstâncias. Hoje é a primeira vez que o seu Papai e Vovô o estão levando para o trabalho. Em um velho barco de madeira eles remam muito até chegar em alto mar e, com nenhuma terra à vista, eles param e esperam. Uma grande surpresa espanta o garoto quando ele descobre o tipo de trabalho incomum de sua família. Ele deve seguir o exemplo de seu Papai, ou de seu Vovô? Será que ele vai ser capaz de encontrar o seu próprio caminho no meio dessas opiniões conflitantes e tradições fora de moda? Faz parte da Coleção Pixar Curtas 02.","first_air_date":"2012-02-10","runtime":7,"episode_run_time":[7],"vote_average":7.8,"created_by":["Pixar"],"production_companies":[{"name":"Pixar"}],"cast":["Tony Fucile","Krista Sheffler","Phil Sheridan"],"backdrop_path":"https://image.tmdb.org/t/p/original/yJAQSaH6L2TIpF23ojGiBxtbVJJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/9euW64JUgFlA7fxN8lAmwK6gUaQ.jpg","certification":"N/A","genres":["Animação","Família","Fantasia"],"trailer":"N/A"},
"11047":{"id":"11047","name":"Asterix, o Gaulês","slug":"asterix-o-gaules","original_title":"Astérix le Gaulois","overview":"No ano 50 a.C. a Gália é ocupada pelos romanos. Mas, a pequena vila de Asterix e seus amigos ainda resiste com a ajuda de uma poção mágica, que lhes dá uma força sobre-humana. Desesperado para descobrir a poção secreta dos gauleses, um centurião romano passa a espionar a vila. O objetivo é se tornar invencível e acabar com qualquer obstáculo entre ele e o trono de César. Mas, Panoramix, o druida da vila prepara uma poção especial para ele. Nosso herói Asterix dá a ele a mistura: um tônico poderoso que faz seu cabelo crescer, crescer...","first_air_date":"1967-12-20","runtime":65,"episode_run_time":[65],"vote_average":6.4,"created_by":["Dargaud Films","Belvision"],"production_companies":[{"name":"Dargaud Films"},{"name":"Belvision"}],"cast":["Roger Carel","Jacques Morel","Pierre Tornade","Lucien Raimbourg","Pierre Trabaud"],"backdrop_path":"https://image.tmdb.org/t/p/original/1ljIHeb8SFJVaXNAZfncSZvcHPx.jpg","poster_path":"https://image.tmdb.org/t/p/original/8K2yemr1pcmYe1DcJ0586SRLsEp.jpg","certification":"N/A","genres":["Família","Animação","Aventura","Comédia"],"trailer":"N/A"},
"13062":{"id":"13062","name":"Pular","slug":"pular","original_title":"Boundin'","overview":"Uma ovelha feliz e orgulhosa dança alegremente, até o dia em que seu pelo é tosquiado completamente. A ovelha fica deprimida e amuada, até receber uma lição de que o importante não são as aparências. Faz parte da Coleção Pixar Curtas 01.","first_air_date":"2003-11-04","runtime":5,"episode_run_time":[5],"vote_average":6.5,"created_by":["Pixar"],"production_companies":[{"name":"Pixar"}],"cast":["Bud Luckey"],"backdrop_path":"https://image.tmdb.org/t/p/original/creJJVuDkR0MI240P9U3eTrcQkf.jpg","poster_path":"https://image.tmdb.org/t/p/original/1KpJP5aLCRE0baQfX33H447p30T.jpg","certification":"N/A","genres":["Animação","Família","Música","Comédia"],"trailer":"N/A"},
"378111":{"id":"378111","name":"Missão Cegonha","slug":"missao-cegonha","original_title":"A Stork's Journey","overview":"Mesmo que todos digam o contrário (e até mesmo sua aparência afirme), o pardal Richard está convicto de que ele é, de fato, uma cegonha. Para mostrar a todos que está certo, ele toma uma atitude ousada: decide partir em uma longa jornada de inverno para a África, para completar um rito de passagem e enfim se tornar uma cegonha de respeito.","first_air_date":"2017-04-28","runtime":85,"episode_run_time":[85],"vote_average":5.9,"created_by":["Walking The Dog","Den Siste Skilling","Knudsen & Streuber Medienmanufaktur","Ulysses Filmproduktion","Melusine Productions"],"production_companies":[{"name":"Walking The Dog"},{"name":"Den Siste Skilling"},{"name":"Knudsen & Streuber Medienmanufaktur"},{"name":"Ulysses Filmproduktion"},{"name":"Melusine Productions"}],"cast":["Christian Gaul","Tilman Döbler","Nicolette Krebitz","Maud Ackermann","Schroeder Kacmar"],"backdrop_path":"https://image.tmdb.org/t/p/original/3BWd3jRlr06E022BKzQ8MxNfoRX.jpg","poster_path":"https://image.tmdb.org/t/p/original/6VTYZiDRHBMEEtzv7CPwr0ZruPn.jpg","certification":"L","genres":["Animação","Família","Fantasia","Aventura","Comédia"],"trailer":"yTUT2C-NzfI"},
"56590":{"id":"56590","name":"Grandes Astros: Superman","slug":"grandes-astros-superman","original_title":"All Star Superman","overview":"Lex Luthor dá inicio mais uma vez de livrar o mundo do Superman. Com um tipo de radiação solar, Lex Luthor consegue envenenar Superman, que está morrendo lentamente. Com pouco tempo restando, o ultimo filho de Krypton precisa revelar sua identidade secreta a Lois Lane e combater Lex Luthor pela ultima vez.","first_air_date":"2011-01-01","runtime":76,"episode_run_time":[76],"vote_average":6.8,"created_by":["Warner Bros. Animation","DC"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"DC"}],"cast":["James Denton","Christina Hendricks","Anthony LaPaglia","Ed Asner","Linda Cardellini"],"backdrop_path":"https://image.tmdb.org/t/p/original/FTpFec420ztDa6HSpwLxGuwzis.jpg","poster_path":"https://image.tmdb.org/t/p/original/gCXgzah59pQI3hJAkuW7epGMBHG.jpg","certification":"L","genres":["Animação","Ficção científica","Ação","Aventura"],"trailer":"N/A"},
"13355":{"id":"13355","name":"Scooby-Doo! Piratas à Bordo","slug":"scooby-doo-piratas-a-bordo","original_title":"Scooby-Doo! Pirates Ahoy!","overview":"Os setes mares do bom-humor serão navegados por Scooby-Doo, Salsicha, Fred, Daphne e Velma durante um cruzeiro ao lendário e temido Triângulo das Bermudas! Assombrações e muitos sustos esperam por eles em cada esquina, e a tripulação desse navio inclui desde alienígenas até esqueléticos piratas fantasmas. Eles preferem afundar outras embarcações a tiro de canhão. Se a turminha da Mistérios S.A. não resolver essa parada rapidamente, eles talvez tenham que caminhar pela prancha e se tornarem as próximas vítimas do fatídico Triângulo!","first_air_date":"2006-09-19","runtime":70,"episode_run_time":[70],"vote_average":7.5,"created_by":["Warner Bros. Animation","Hanna-Barbera Productions"],"production_companies":[{"name":"Warner Bros. Animation"},{"name":"Hanna-Barbera Productions"}],"cast":["Frank Welker","Casey Kasem","Mindy Cohn","Grey DeLisle","Ron Perlman"],"backdrop_path":"https://image.tmdb.org/t/p/original/t14yKET7koe0TtJw4Pk923Ntqyq.jpg","poster_path":"https://image.tmdb.org/t/p/original/k7tebx1uIIHLbL6jle9g6pe9US1.jpg","certification":"N/A","genres":["Fantasia","Animação","Comédia","Família","Mistério","Aventura"],"trailer":"N/A"},
