"419566":{"id":"419566","name":"Lego Jurassic World: A Fuga do Indominus Rex","slug":"lego-jurassic-world-a-fuga-do-indominus-rex","original_title":"LEGO Jurassic World: The Indominus Escape","overview":"No filme LEGO Jurassic World: A Fuga do Indominus Rex, quando Simon Masrani acidentalmente destrói uma das principais atrações do parque (ele realmente deveria aprender como pilotar um helicóptero), ele pede ajuda para a sua confiável funcionária Claire para salvar o dia. Depois de uma rápida dino-construção de DNA no laboratório do Dr. Wu, Claire apresenta a solução perfeita e que com certeza vai agradar Masrani e as crianças do mundo inteiro – o Indominus rex – o maior, mais inteligente e assustador dinossauro amante de cachorro quente de todos os tempos! Infelizmente, tragédias ocorrem depois que o Indominus come todos os cachorros quentes e escapa de seu confinamento faminto.","first_air_date":"2016-10-03","runtime":24,"episode_run_time":[24],"vote_average":5.7,"created_by":["LEGO","Universal Pictures"],"production_companies":[{"name":"LEGO"},{"name":"Universal Pictures"}],"cast":["Bryce Dallas Howard","A.J. LoCascio","Sendhil Ramamurthy","Fred Tatasciore","Jake Johnson"],"backdrop_path":"https://image.tmdb.org/t/p/original/w1W8Ukf6Kx8q2oVSwwG10kOvqCi.jpg","poster_path":"https://image.tmdb.org/t/p/original/gRgJFyxaNp2VEWSTGy5miqNxxs4.jpg","certification":"L","genres":["Família","Animação","Comédia"],"trailer":"N/A"},
