"456611":{"id":"456611","name":"Lupin III: Goemon, Rastros de Sangue","slug":"lupin-iii-goemon-rastros-de-sangue","original_title":"LUPIN THE IIIRD 血煙の石川五ェ門","overview":"Um jovem Goemon é contratado como guarda-costas para salvar a cabeça da família Yakuza de Steel Dragons contra uma máfia rival. Depois de impedi-lo de ser atingido por uma bala em seu barco de apostas de luxo, uma enorme explosão termina a vida do patrão; Foi causado por um homem misterioso, armado com dois machados. Enfurecido, Goemon tenta ir atrás dele, mas o homem consegue escapar em um dos barcos de resgate do barco. Lupin, Jigen e Fujiko, que estavam prestes a deixar o navio depois de roubar uma sala cheia de dinheiro, testemunhar a cena e Fujiko reconhece o homem misterioso, que não é nada mais e nada menos do que Hawk, também conhecido como \"o fantasma das Bermudas\". A lenda diz que ele matou um exército de 2000 homens sozinhos, mas supostamente, foi confirmado morto por 20 anos. Por que ele está vivo, e por que ele está no Japão? O Inspetor Zenigata segue os passos de Hawk para capturá-lo, bem como Goemon, que procurará vingar a morte de seu chefe para restaurar sua honra.","first_air_date":"2017-02-04","runtime":54,"episode_run_time":[54],"vote_average":7.8,"created_by":["Telecom Animation Film","Free As A Bird","TFC","TMS Entertainment"],"production_companies":[{"name":"Telecom Animation Film"},{"name":"Free As A Bird"},{"name":"TFC"},{"name":"TMS Entertainment"}],"cast":["栗田貫一","小林清志","Miyuki Sawashiro","Daisuke Namikawa","Koichi Yamadera"],"backdrop_path":"https://image.tmdb.org/t/p/original/viu7bXs0coL7c1B7J0izS6Xs5wT.jpg","poster_path":"https://image.tmdb.org/t/p/original/1xXDE7NdTy0CYNJ4IFBGOzlj7oc.jpg","certification":"14","genres":["Animação","Ação","Crime","Drama"],"trailer":"N/A"},
