"77499":{"id":"77499","name":"Barbie: Um Natal Perfeito","slug":"barbie-um-natal-perfeito","original_title":"Barbie: A Perfect Christmas","overview":"Junte-se a Barbie e suas irmãs Skipper, Stacie e Chelsea e veja como seus planos de férias se transformam numa aventura inesperada e uma lição reconfortante. Depois que uma nevasca desvia seu avião, as garotas se vêem longe de seu destino em Nova York e de seus sonhos de férias. Agora encalhados em uma pousada remota na pequena cidade de Tannenbaum, as irmãs são recebidas por novos amigos e experiências mágicas. Em agradecimento pela maravilhosa hospitalidade que recebem, eles usam seus talentos musicais para fazer uma apresentação para toda a cidade. Barbie e suas irmãs percebem que a alegria de estar junto é o que realmente faz um Natal Perfeito!","first_air_date":"2011-11-03","runtime":74,"episode_run_time":[74],"vote_average":6.7,"created_by":["Technicolor Animation","Mattel"],"production_companies":[{"name":"Technicolor Animation"},{"name":"Mattel"}],"cast":["Diana Kaarina","Jennifer Waris","Rachel Harrison","Nevada Brandt","Lauren Lavoie"],"backdrop_path":"https://image.tmdb.org/t/p/original/qoN2Ytg1mEyTkyJdt6xc1kB2ll.jpg","poster_path":"https://image.tmdb.org/t/p/original/rdWcoJMn7ZwXpTTChNy1OIqwit3.jpg","certification":"N/A","genres":["Animação","Família"],"trailer":"N/A"},
