"167666":{"id":"167666","name":"Monster High: Fuga da Ilha do Esqueleto","slug":"monster-high-fuga-da-ilha-do-esqueleto","original_title":"Monster High: Escape from Skull Shores","overview":"Com o início das férias de verão, Frankie e as garotas fazem uma viagem de barco até a grande barreira de corais. No caminho, a embarcação é atacada por um Kraken. À deriva, elas conhecem o estranho Sr. Farnon, que promete ajudá-las a seguir viagem. Mas antes, ele faz uma parada inesperada na misteriosa ilha do esqueleto, trazendo à tona a relação de Frankie com um horripilante monstro que rodeia a ilha há centenas de anos amedrontando e aterrorizando quem se aproxima.","first_air_date":"2012-02-16","runtime":45,"episode_run_time":[45],"vote_average":7.8,"created_by":["Mattel Playground Productions","Mattel","Nerd Corps Entertainment"],"production_companies":[{"name":"Mattel Playground Productions"},{"name":"Mattel"},{"name":"Nerd Corps Entertainment"}],"cast":["Kate Higgins","Laura Bailey","Salli Saffioti","Debi Derryberry","Evan Smith"],"backdrop_path":"https://image.tmdb.org/t/p/original/fpx6aDOHEEuLHEo6glbFU0ueeo8.jpg","poster_path":"https://image.tmdb.org/t/p/original/4tnA14gRuukK7dvpIpln0igVqHa.jpg","certification":"L","genres":["Animação","Família","Fantasia"],"trailer":"N/A"},
