"24480":{"id":"24480","name":"Parcialmente Nublado","slug":"parcialmente-nublado","original_title":"Partly Cloudy","overview":"Gus é uma nuvem cinzenta solitária e insegura que esculpe filhotes. Cada nuvem é responsável por esculpir um tipo de filhote, como de cachorro, gato ou bebê humano. Após esculpidos, as nuvens passam os filhotes para sua cegonha, que entrega para os futuros pais. O problema é que os bebês que Gus é responsável por esculpir, diferente de outras nuvens, são um tanto perigosos, como crocodilos, porcos-espinhos, entre outros. E a cegonha Peck, companheiro inseparável de Gus, é quem lida com a entrega desses filhotes. As criações de Gus são verdadeiras obras de arte, mas para Peck não são mais que um punhado de entregas. Á medida que as criações de Gus ficam mais “indisciplinadas”, o trabalho de Peck fica mais difícil. Como a cegonha vai lidar com o seu trabalho pavoroso e o temperamento de seu amigo Gus ao mesmo tempo? Faz parte da Coleção Pixar Curtas 02.","first_air_date":"2009-05-28","runtime":6,"episode_run_time":[6],"vote_average":7.8,"created_by":["Pixar"],"production_companies":[{"name":"Pixar"}],"cast":["Tony Fucile","Lori Richardson"],"backdrop_path":"https://image.tmdb.org/t/p/original/sdyRGgBTHIqwDieL7WepBWlkNFh.jpg","poster_path":"https://image.tmdb.org/t/p/original/oqYX2AJV53ibLVPrUZ1Z5XlGv5U.jpg","certification":"N/A","genres":["Animação","Família","Comédia"],"trailer":"N/A"},
