"680813":{"id":"680813","name":"Flee: Nenhum Lugar Para Chamar de Lar","slug":"flee-nenhum-lugar-para-chamar-de-lar","original_title":"Flugt","overview":"O documentário animado nos apresenta Amin Nawabi (pseudônimo), um intelectual altamente graduado de 36 anos, luta com um segredo doloroso que manteve escondido por vinte anos e que ameaça desestabilizar a vida que construiu para si e para o futuro marido. Recontada pelo diretor Jonas Poher Rasmussen, seu amigo próximo, a história extraordinária da viagem feita por Amin na infância, como refugiado afegão, vem à luz pela primeira vez. História de autodescoberta, a animação mostra que só quem confronta o passado pode criar um futuro, e só quem para de fugir de si mesmo descobre o verdadeiro significado de ter um lar.","first_air_date":"2021-06-17","runtime":89,"episode_run_time":[89],"vote_average":7.8,"created_by":["Final Cut for Real","Vivement lundi !","Sun Creature","Participant","MostFilm","Mer Film","VPRO","Vice Studios","RYOT Films","Left Handed Films","ARTE"],"production_companies":[{"name":"Final Cut for Real"},{"name":"Vivement lundi !"},{"name":"Sun Creature"},{"name":"Participant"},{"name":"MostFilm"},{"name":"Mer Film"},{"name":"VPRO"},{"name":"Vice Studios"},{"name":"RYOT Films"},{"name":"Left Handed Films"},{"name":"ARTE"}],"cast":["Amin Nawabi","Daniel Karimyar","Fardin Mijdzadeh","Milad Eskandari","Belal Faiz"],"backdrop_path":"https://image.tmdb.org/t/p/original/CKGSEnFTpcxPJM5TzTFUJz53s.jpg","poster_path":"https://image.tmdb.org/t/p/original/92sguHEFTZm5bvvTYRoGksFrasb.jpg","certification":"N/A","genres":["Documentário","Animação"],"trailer":"Yfjjv9aVSaU"},
