"50388":{"id":"50388","name":"Rei dos Espinhos","slug":"rei-dos-espinhos","original_title":"いばらの王 -King of Thorn-","overview":"Após uma infecção viral conhecida como o vírus Medusa aparecer na Sibéria e contagiar toda a Terra, 160 humanos são escolhidos para testar uma cura desenvolvida pela organização Venus Gate. Kasumi é selecionada como uma das 160 pessoas para o experimento. Ela é forçada a entrar no tratamento e ao sono frio sem a irmã gêmea Shizuku, com quem se preocupa muito. Alguns dos que estavam em hibernação acordaram abruptamente, encontrando as instalações onde deveriam ser tratados em estado de deterioração, invadida por uma selva exuberante de árvores e vinhas estranhas cobertas de espinhos. Logo os sobreviventes descobrem que toda a ruína está cheia de criaturas estranhas e outras aberrações monstruosas da natureza. Pensando que uma grande quantidade de tempo passou desde a sua chegada à ilha, em breve os sobreviventes descobriram não só que o sono deles era muito curto para marcar alterações tão dramáticas, mas também que a situação em si é muito maior do que eles poderiam imaginar.","first_air_date":"2010-05-01","runtime":109,"episode_run_time":[109],"vote_average":6.6,"created_by":["KADOKAWA","Bandai Visual","SUNRISE","Enterbrain","TV Tokyo","dentsu","Sony PCL"],"production_companies":[{"name":"KADOKAWA"},{"name":"Bandai Visual"},{"name":"SUNRISE"},{"name":"Enterbrain"},{"name":"TV Tokyo"},{"name":"dentsu"},{"name":"Sony PCL"}],"cast":["Kana Hanazawa","廣田行生","Misaki Kuno","磯部勉","Sayaka Ohara"],"backdrop_path":"https://image.tmdb.org/t/p/original/y2E2lNUE2VQbHchKpvGV3rVXS8K.jpg","poster_path":"https://image.tmdb.org/t/p/original/iNXmG9gDtINaBSsNz6os1I0J4rq.jpg","certification":"N/A","genres":["Fantasia","Animação","Ficção científica"],"trailer":"N/A"},
