"16225":{"id":"16225","name":"Heavy Metal 2000","slug":"heavy-metal-2000","original_title":"Heavy Metal 2000","overview":"Há muito tempo atrás, os arakacianos dominavam as galáxias. Havia terror e devastação. A fonte de sua força terrível encontrava-se em uma câmara do planeta Uroboris. A água lá contida era a promessa de vida eterna. A câmara só podia ser aberta com uma única chave que, se encontrada, levaria seu portador de volta à fonte da imortalidade mas a chave levaria à loucura quem a tocasse. Quando os arakacianos foram finalmente derrotados a câmara foi trancada e a chave lançada no espaço. Por muito tempo ela não foi encontrada, mas Tyler (Michael Ironside), um pirata do espaço, descobre o cristal verde que é a chave para a imortalidade. Enlouquecido, ele promove uma matança contra os habitantes do planeta Eden. A única sobrevivente é Julie (Julie Strain), que jura matá-lo para vingar a morte dos pais e o seqüestro de sua irmã. Mas antes ela precisa impedir que ele chegue ao portal que o tornará imortal.","first_air_date":"2000-04-19","runtime":88,"episode_run_time":[88],"vote_average":6.0,"created_by":["Helkon Media","Das Werk Productions","CinéGroupe"],"production_companies":[{"name":"Helkon Media"},{"name":"Das Werk Productions"},{"name":"CinéGroupe"}],"cast":["Michael Ironside","Julie Strain","Billy Idol","Pier Paquette","Sonja Ball"],"backdrop_path":"https://image.tmdb.org/t/p/original/f5C03doOWiauu37bToKXtpgP5bS.jpg","poster_path":"https://image.tmdb.org/t/p/original/mzOgKYOXiuwE5DIfagFs34bOb3J.jpg","certification":"N/A","genres":["Ação","Aventura","Animação","Fantasia","Ficção científica"],"trailer":"N/A"},
