"399106":{"id":"399106","name":"Piper: Descobrindo o Mundo","slug":"piper-descobrindo-o-mundo","original_title":"Piper","overview":"A história de um pequeno pássaro que vive próximo a praia e se aventura pela primeira vez a sair do seu ninho e ir atrás de comida. Uma perspectiva delicada da vida humana sob o olhar do pequenino animal.","first_air_date":"2016-06-16","runtime":6,"episode_run_time":[6],"vote_average":8.1,"created_by":["Pixar","Walt Disney Pictures"],"production_companies":[{"name":"Pixar"},{"name":"Walt Disney Pictures"}],"cast":[],"backdrop_path":"https://image.tmdb.org/t/p/original/4GWYk5VP9qu1rNSeNAwNaBy9mwS.jpg","poster_path":"https://image.tmdb.org/t/p/original/45aUXGecIQKawGXfLchHJaYcF2F.jpg","certification":"N/A","genres":["Família","Animação"],"trailer":"N/A"},
"19165":{"id":"19165","name":"Em Busca do Vale Encantado V: A Ilha Misteriosa","slug":"em-busca-do-vale-encantado-v-a-ilha-misteriosa","original_title":"The Land Before Time V: The Mysterious Island","overview":"Além do Vale Encantado existe uma ilha de beleza e mistério. Neste lugar maravilhoso, Littlefoot, Saura, Espora, Patassaura e Petrúcio descobrirão velhos e novos amigos, enfrentarão incríveis desafios e viverão a maior aventura de suas vidas! É a mais nova história recheada de canções do clássico Em Busca do Vale Encantado. Um dia, uma nuvem de insetos devoradores de plantas desce sobre o Vale Encantado, e acabam com todas as folhinhas à vista. Agora, o Vale está totalmente destruído e todos precisam buscar um novo lar até que as plantas cresçam novamente. Mas quando as brigas entre os adultos ameaçam separa-los, Littlefoot e seus amigos resolvem partir sozinhos. Em sua busca, eles encontram, as Grandes Águas – onde estranhas criaturas vivem e nadam – que os levam à uma misteriosa ilha onde eles encontram Chomper, o adorável amigo de dentes afiados de “A Grande Aventura no Vale”. Porém, agora Chomper precisa proteger seus amiguinhos das feras, incluindo seus próprios país!.","first_air_date":"1997-09-12","runtime":74,"episode_run_time":[74],"vote_average":6.2,"created_by":["Universal Cartoon Studios","AKOM Production Company"],"production_companies":[{"name":"Universal Cartoon Studios"},{"name":"AKOM Production Company"}],"cast":["John Ingle","Brandon La Croix","Aria Noelle Curzon","Rob Paulsen","Anndi McAfee"],"backdrop_path":"https://image.tmdb.org/t/p/original/1U2wQbsCqAydFB4jMC7fqs8Frs3.jpg","poster_path":"https://image.tmdb.org/t/p/original/ivgTNiMRRByVNIV3knRz38BT48r.jpg","certification":"L","genres":["Animação","Família","Aventura"],"trailer":"N/A"},
"432383":{"id":"432383","name":"Amigos Alienígenas","slug":"amigos-alienigenas","original_title":"Luis und die Aliens","overview":"A vida de Louis, um menino de doze anos, muda completamente quando a nave espacial de três alienígenas cai nos fundos do quintal de sua casa. Seu pai, um ufologista famoso, congelaria os novos amigos na primeira oportunidade, por isso ele precisa protegê-los e ajudá-los a descobrir o paradeiro da nave mãe, para que só assim eles consigam voltar para casa.","first_air_date":"2018-05-09","runtime":86,"episode_run_time":[86],"vote_average":6.4,"created_by":["Ulysses Filmproduktion","Fabrique d'images","A. Film Production","MEDIA Programme of the European Union","Majestic Filmproduktion","Telepool","Global Screen","Fox International Productions Germany","Viva Kids","CNC"],"production_companies":[{"name":"Ulysses Filmproduktion"},{"name":"Fabrique d'images"},{"name":"A. Film Production"},{"name":"MEDIA Programme of the European Union"},{"name":"Majestic Filmproduktion"},{"name":"Telepool"},{"name":"Global Screen"},{"name":"Fox International Productions Germany"},{"name":"Viva Kids"},{"name":"CNC"}],"cast":["Callum Maloney","Dermot Magennis","Ian Coppinger","Paul Tylak","Lucy Carolan"],"backdrop_path":"https://image.tmdb.org/t/p/original/p3ZII4uLzv2y2FV4XUqBYNfmLN6.jpg","poster_path":"https://image.tmdb.org/t/p/original/yZY8LoT91xzaWa08m3YqBynA4Jb.jpg","certification":"L","genres":["Animação","Família"],"trailer":"N/A"},
