"31933":{"id":"31933","name":"Em Busca do Vale Encantado XII: O Grande Dia dos Voadores","slug":"em-busca-do-vale-encantado-xii-o-grande-dia-dos-voadores","original_title":"The Land Before Time XII: The Great Day of the Flyers","overview":"Petrúcio está passando por dificuldades para preparar o Dia dos Voadores: um evento importante para todos os animais voadores do Grande Vale, onde os jovens animais têm que fazer um vôo perfeito para provar que podem acompanhar os adultos. Petrie, um sujeito muito ansioso, tem problemas para voar em formação junto com os outros - ele faz mais o tipo radical, com vôos radicais bem ao seu jeito. Ao mesmo tempo, uma estranha figura chega ao Grande Vale, mas Littlefoot e seus amigos querem saber de quem se trata. O estranho se chama Guido e eles nunca viram nada parecido, especialmente por causa da sua plumagem supercolorida! Saura tem seus próprios problemas, especialmente com seu velho pai e sua nova namorada Tria, que acaba de entrar para a família. Todas essas aventuras acontecem na véspera do Dia dos Voadores, quando Guido descobre quem ele realmente é e acaba liderando todos numa arriscada aventura para o Misterioso Além.","first_air_date":"2006-02-27","runtime":77,"episode_run_time":[77],"vote_average":6.2,"created_by":["Universal Animation Studios"],"production_companies":[{"name":"Universal Animation Studios"}],"cast":["John Ingle","Nick Price","Frank Welker","Aria Noelle Curzon","Rob Paulsen"],"backdrop_path":"https://image.tmdb.org/t/p/original/kBgDeXKBBrVdbkm0ItJA2Z0avlF.jpg","poster_path":"https://image.tmdb.org/t/p/original/1ti4gUlkYfxQqupXTLvIHySlY2W.jpg","certification":"L","genres":["Animação","Família","Aventura"],"trailer":"N/A"},
