"339877":{"id":"339877","name":"Com Amor, Van Gogh","slug":"com-amor-van-gogh","original_title":"Loving Vincent","overview":"Um ano após o suicídio de Vincent Van Gogh, Armand Roulin encontra uma carta por ele enviada ao irmão Theo, que jamais chegou ao seu destino. Após conversar com o pai, carteiro que era amigo pessoal de Van Gogh, Armand é incentivado a entregar ele mesmo a correspondência. Desta forma, ele parte para a cidade francesa de Arles na esperança de encontrar algum contato com a família do pintor falecido. Lá, inicia uma investigação junto às pessoas que conheceram Van Gogh, no intuito de decifrar se ele realmente se matou.","first_air_date":"2017-06-22","runtime":94,"episode_run_time":[94],"vote_average":8.0,"created_by":["Breakthru Films","Trademark Films","Odra Film","Good Deed Entertainment","Centrum Technologii Audiowizualnych"],"production_companies":[{"name":"Breakthru Films"},{"name":"Trademark Films"},{"name":"Odra Film"},{"name":"Good Deed Entertainment"},{"name":"Centrum Technologii Audiowizualnych"}],"cast":["Douglas Booth","Robert Gulaczyk","Eleanor Tomlinson","Helen McCrory","Saoirse Ronan"],"backdrop_path":"https://image.tmdb.org/t/p/original/xW54kLO7ZB683CwMbGSN3ELSS1K.jpg","poster_path":"https://image.tmdb.org/t/p/original/pw72rhXTRbIel6iNWKHUqiIvcZm.jpg","certification":"14","genres":["Animação","Drama","Mistério","História"],"trailer":"0PpAjxnVoSY"},
