"326215":{"id":"326215","name":"Epa! Cadê o Noé?","slug":"epa-cade-o-noe","original_title":"Ooops! Noah Is Gone...","overview":"É o fim do mundo e uma enchente está chegando. Uma arca é construída para salvar todos os animais, mais Dave e seu filho Finny, um par de Nestrians desajeitados, são excluídos. Escondidos a bordo com a ajuda involuntária de Hazel e sua filha Leah, dois Grymps, eles pensam que estão a salvo. Até a curiosidade das crianças distraí-las e levá-las para fora da arca. Agora, Finny e Leah precisam sobreviver a predadores famintos, a inundação e tentar chegar ao topo de uma montanha, enquanto Dave e Hazel deve colocar de lado suas diferenças e salvar seus filhos.","first_air_date":"2015-03-26","runtime":85,"episode_run_time":[85],"vote_average":6.4,"created_by":["Moetion Films","Ulysses Filmproduktion","Fabrique d'images","Skyline Entertainment","Grid Animation","Studio Rakete"],"production_companies":[{"name":"Moetion Films"},{"name":"Ulysses Filmproduktion"},{"name":"Fabrique d'images"},{"name":"Skyline Entertainment"},{"name":"Grid Animation"},{"name":"Studio Rakete"}],"cast":["Callum Maloney","Dermot Magennis","Ava Connolly","Tara Flynn","Paul Tylak"],"backdrop_path":"https://image.tmdb.org/t/p/original/zABJBMFSc19yLR0bzK6AvFxreVb.jpg","poster_path":"https://image.tmdb.org/t/p/original/tWQgAbAWp1Iu0f3dTQnTYnEEpUW.jpg","certification":"L","genres":["Animação","Aventura","Comédia","Família"],"trailer":"N/A"},
"595172":{"id":"595172","name":"O Peregrino","slug":"o-peregrino","original_title":"The Pilgrim's Progress","overview":"Baseado na obra-prima épica de John Bunyan, O Peregrino é um dos livros mais populares de todos os tempos, sendo uma das histórias mais importantes da nossa fé, pois ajuda as famílias a entender que a caminhada espiritual é a jornada mais importante da vida, assim como destaca a importância de permanecer no caminho divino, mesmo quando o percurso se torna difícil.","first_air_date":"2019-04-18","runtime":108,"episode_run_time":[108],"vote_average":7.6,"created_by":["Cat In The Mill Studio","Herald Entertainment"],"production_companies":[{"name":"Cat In The Mill Studio"},{"name":"Herald Entertainment"}],"cast":["David Thorpe","John Rhys-Davies","Kristyn Getty","Tristan Beint","Justin Butcher"],"backdrop_path":"https://image.tmdb.org/t/p/original/l2Ao3NXfrXtWzlBZ5DnP2l2szJj.jpg","poster_path":"https://image.tmdb.org/t/p/original/dt8oZEQchflkVoTkrWl9mah699H.jpg","certification":"N/A","genres":["Animação","Aventura"],"trailer":"N/A"},
