"48874":{"id":"48874","name":"O Cântico de Natal dos Flintstones","slug":"o-cantico-de-natal-dos-flintstones","original_title":"A Flintstones Christmas Carol","overview":"É véspera de Natal e os atores da Bedrock Community apresentam sua versão de \"A Christmas Carol\". Fred, no papel de Scrooge, torna-se tão autoabsorvido que se esquece de comprar presentes para sua família, se esquece de apanhar Pedrita do Cave Care center, e acusa Barney de ser um dedo duro. Fred com um ego do tamanho de um tiranossauro, começa a agir como o papel que ele desempenha neste especial de Natal.","first_air_date":"1994-11-21","runtime":70,"episode_run_time":[70],"vote_average":6.7,"created_by":["Hanna-Barbera Productions"],"production_companies":[{"name":"Hanna-Barbera Productions"}],"cast":["Henry Corden","Jean Vander Pyl","Frank Welker","B.J. Ward","Russi Taylor"],"backdrop_path":"https://image.tmdb.org/t/p/original/9g5lQwq6VN4TGPBXEW2nvWLK4b4.jpg","poster_path":"https://image.tmdb.org/t/p/original/uLAgV6pCbl5XqLUf6hUMxcTQmtq.jpg","certification":"N/A","genres":["Animação","Comédia","Família","Cinema TV"],"trailer":"N/A"},
